    copyright: "© EckiHag",
    title: "Die Schule - Das Dorf Val Jabert am Lac St. Jean",
    description:
      'Das Museumsdorf erinnert an das alte Industriedorf von 1902-1927 mit elektrischem Strom (eine Ausnahme zu dieser Zeit) und Wasserfall mit Energiegewinnung und Gewinnung von "pulpe" Zelluloseproduktion. Die Stämme wurden oben in den Wasserfall geworfen und unten für die Produktion gesammelt. Einige Arbeiter blieben wochenlang im Wald, andere arbeiteten an den Maschinen. Es wird als glückliches und reiches Dorf beschrieben. Man kann die Wohnhäuser und Straßen besichtigen, auch in sich zusammengestürzte Häuser. Sehr schön dort mehrere Stunden zu verbringen. Mit der Wirtschaftskrise ging das Dorf Ende der zwanziger Jahre unter.',
