    title: "Yosemite-Nationalpark",
    description:
      "Der Anfang war schwer: wir hatten mit ca. 70 Minuten Anfahrt gerechnet, was sich am Ende auf 3 Stunden summierte. Das erste Mal seit unserer Reise erleben wir Bewölkung. Fast schon Regen (5-6 Tropfen). Aber nachdem wir Anfahrt und Wetter überwunden haben, bringen uns die wunderbaren Anblicke im Yosomite-Valley und nicht zuletzt die Wanderung zum Mariposa-Grove mit den wunderbaren Bäumen zu dem Fazit: auch dieser Park ist ein lohnenswertes Ziel gewesen.",
