    ord: 15,
    copyright: "© EckiHag",
    title: "Miwok und Paiute",
    description:
      'Eine Ausstellung zeigt die Kultur der Miwok und der Paiute die beiden Hauptstämme, die in der Region lebten. Im Außenbereich gibt es ein Dorf mit Zelten aus Rinde, Erde und Strauchteilen, in dem diese Menschen lebten.\nDie indigenen Völker hatten enge Verbindungen zur Natur und lebten in Einklang mit der Umwelt. Mit der Ankunft der europäischen Siedler und der Gründung des Yosemite-Nationalparks wurden sie jedoch verdrängt und aus ihrem angestammten Land vertrieben. Eine weitere Geschichte von Flucht und Vertreibung mehr.\nDie Menschen der ehemaligen "Indianer-Stämme" leben heute an der unteren Einkommensskala der Gesellschaft und sind häufig sofort durch Armut, Alkoholismus und Obdachlosigkeit zu erkennen. Anders in den Reservaten, wo sie zum Teil alte Lebensweisen beibehalten und westliche Lebensweisen nur zum Teil an sich heranlassen.\nWenn man durchs Land fährt, fallen immer wieder Wohneinheiten aus zerbrechlichen Häusern und Campern auf, an denen Pickups geparkt sind. Sie liegen sehr zerstreut, weit voneinander in Steppen- oder Wüsten-Landschaften insbesondere in Arizona und den angrenzenden Bundesstaaten. Hier leben dann in der Regel Nachkommen der indigenen Völker.',
