    copyright: "© EckiHag",
    title: "Die Höhe ist beeindruckend. ",
    description: "Am Ende haben wir den Park im Nebel verlassen ... oder war es Rauch? In den Wäldern wird tatsächlich Holz aufgeschichtet und kontrolliert verbrannt.\n",
    image: "./uploads/picscollection/2023-10-23_23-44-35-5bc55170-71ed-11ee-af5f-b9598f285b66.jpg",
