    ord: 490,
    copyright: "© EckiHag",
    title: "Unser Haus",
    description:
      'Nachdem wir den Code für das Haus mit Hilfe eines oben wohnenden Chinesen bekommen und betreten haben, stellen wir fest: wir sind allein in dem Haus mit großer Küche, 2 Bädern und mehreren Schlafzimmer. Wir sind sehr zufrieden. Erst als wir schon 2 Stunden da sind, taucht Marlene auf, die honduranische "Hauskeeperin", die nur ein paar Brocken Englisch spricht, aber dank meiner Erinnerung an die Reise nach Honduras schnell auftaut und in einen regen Austausch mit mir kommt. Dies wiederum gelingt dem nachfolgenden Mitbewohner nicht. Als er die Küche betritt, hat er einen Motoradhelm auf, grüßt nicht und kommt nach einigen Minuten mit einem fetten Kopfhörer zurück, um sein Essen heiß machen. Mein Theorie ist, das er stumm ist, Cordulas, dass er einfach nur ignorant ist und kein Manieren hat.',
    image: "./uploads/picscollection/2023-10-26_04-48-42-2c569390-73aa-11ee-887a-730f1ee42127.jpg",
    belongstosource: "isfromaplace",
