    ord: 600,
    copyright: "© EckiHag",
    title: "Millbrae - San Francisco",
    description:
      "Am Morgen fahren wir mit dem Zug nach San Francisco. Zunächst parken wir das Auto am Bahnhof des Bart-Railway-Systems, um dann Zugkarten zu besorgen. An diesem Morgen wird uns wieder sehr deutlich: ohne Smartphone und Kreditkarte können wir nicht reisen. Alles geht mit App und Chip.\nIm Zug treffen wir einen sympathischen, freundlichen und jungen indischen Mann mit Greencard, der die gleiche Strecke fährt und uns in der Unterhaltung in sein Leben als IT-ler im Silicon Valley hineinnimmt, einfach spannend.",
