    ord: 450,
    copyright: "© EckiHag",
    title: "Center for Jewish Culture",
    description:
      'Wir fahren langsam an dem Haus vorbei, wollen ein Foto machen, weil die Ansicht des Hauses so schön ist. Das geht sehr schnell, erst wenige Sekunden später bekommen wir mit: vor dem Haus steht das Schild "Center for Jewish culture". Vor dem Haus steht ein Polizeiwagen, der vor dem Haus sitzende Mann bekommt einen Schrecken, als ob jemand vorbei fährt und mit einer Waffe auf ihn schießt. Wollten wir natürlich nicht, ist aber passiert.\nEs ist wenige Tage nach dem grausamen Angriff der Hamas auf Israel. Eine jüdische Synagogenvorsteherin ist wenige Tage zuvor in den USA erschossen worden. Jüdische Einrichtungen in aller Welt müssen (mal wieder) vor Anschlägen geschützt werden. \nDer Antisemitismus ist auch - wie uns eine jüdische Frau einen Tag später in einem Bus erzählt - tief verwurzelt. Wer als jüdischer Mensch erkennbar ist, ist verletzlich, nur, weil sie oder er jüdisch ist. Schrecklich aber Realität.',
    image: "./uploads/picscollection/2023-10-26_05-40-58-79b0f570-73b1-11ee-887a-730f1ee42127.jpg",
    belongstosource: "isfromaplace",
