    ord: 1230,
    copyright: "© EckiHag",
    title: "TJ & Christina Walkup & C.",
    description:
      'TJ gibt uns mit seiner Frau eine private Führung durch die Gasse. Wir haben interessante Gespräche zu den graffics. TJ ist hier aufgewachsen und erzählt uns einige Hintergründe und Entstehungsgeschichten der Graffitis, sowie deren "tags" (Signaturen). Da die beiden heute ihren 15\n Hochzeitstag feiern, machen sie einen Tag frei. TJ ist Director von Omnific Pictures, einer Filmgesellschaft, die u.a. mit National Geografics und Universal Pictures zusammen arbeitet. Sein letztes großes Projekt ist der Film "Generations", in dem er (storyteller und cartoonist) Geschichten von philippinischen Einwanderern erzählt. TJ & Christina sind sehr sympathisch, liberal in ihren Einstellungen und begegnen uns als sehr weltoffene Menschen.',
    image: "./uploads/picscollection/2023-10-27_15-33-44-731f8fb0-74cd-11ee-b3a7-dbd582cf558d.jpg",
