    title: "Highway 1",
    description:
      "Der Highway 1 in Kalifornien, auch bekannt als Pacific Coast Highway (PCH), ist eine Küstenstraße, die sich entlang der kalifornischen Pazifikküste erstreckt. Die Straße verläuft von Orange County im Süden Kaliforniens bis nach Mendocino County im Norden und bietet atemberaubende Ausblicke auf den Ozean, malerische Klippen, zerklüftete Küstenlandschaften und idyllische Strände. Er gilt als eine der schönsten Küstenstraßen der Welt.\nDer PCH ist in diesem Jahr in beiden Richtungen nicht durchgehend befahrbar. Anfang des Jahres ereigneten sich drei heftige Erdrutsche (Slides) und danach heftige Stürme mit viel Regen. Die Arbeiten in Lucia sind noch nicht fertiggestellt, weshalb wir auf die 101 ausweichen.",
