    description:
      "Wir besuchen einen Laden mit Westernlook: Boot Barn. Es gibt hunderte von Westernstiefel, Hemden, Jacken etc. Nach einigem Anprobieren entscheide ich mich aber gegen den Kauf, weil alles Gewicht hat und mein Paket nach Deutschland teuer genug war.",
    image: "./uploads/picscollection/2023-10-28_18-13-35-f26b5850-75ac-11ee-b8e6-43f1fc8e7696.jpg",
