    copyright: "© EckiHag",
    title: "Halloween",
    description:
      "Viele Häuser sind mit Halloween-Gadgets gestaltet. Halloween ist am 31.10. und auch bei uns inzwischen bekannt. Es kommt aus der irischen Tradition in engem Zusammenhang mit dem 1. November: Allerheiligen.\nVor diesem Haus stehen vier Grabsteine, mit den Inschriften: R.I.P. (Rest in peace), My mother in law, Your name here & The next dog that poops in this yard (yeah).",
