    video: false,
    copyright: "© EckiHag",
    title: "Murals",
    description:
      "Ein weiterer Hinweis eines Gemeindegliedes führt uns zu den Murals of Lompoc: einer Reihe von Wandgemälden, die lose verteilt in einem Stadtviertel zu finden sind und thematisch an der Geschichte von Lompoc orientiert sind. Anschließend gibt es Kaffee im Jack in the box, Boot Barns und Einkauf im Aldi.\nEin paar Hintergründe zu Lompoc und den Indigenous people (first nations? oder first people? I don't like this terms - ask me, if you like to know  why - we had a discussion about that issue with TJ Walkup): After centuries of colonists — from the Spanish to Russian, French to American — first erased, then attempted to tell the histories of the Indigenous people they displaced, the Santa Ynez Band of Chumash Indians now aims to tell its own story in no minor fashion with its upcoming Santa Ynez Chumash Museum and Cultural Center.",
