    title: "Unsere Musik",
    description:
      "Hier ein paar Playlists und Texte, die uns bewegt haben, insbesondere auf den Autofahrten in den vorbeiziehenden Landschaften.\n<br></br>\nCreedence Clearwater Revival.\n\nA horse with no name\nText\nOn the first part of the journey\nI was looking at all the life\nThere were plants and birds and rocks and things\nThere was sand and hills and rings\nThe first thing I met was a fly with a buzz\nAnd the sky with no clouds\nThe heat was hot and the ground was dry\nBut the air was full of sound\nI've been through the desert on a horse with no name\nIt felt good to be out of the rain\nIn the desert you can't remember your name\n'Cause there ain't no one for to give you no pain\nLa la la la la la...\nAfter two days in the desert sun\nMy skin began to turn red\nAnd after three days in the desert fun\nI was looking at a river bed\nAnd the story it told of a river that flowed\nMade me sad to think it was dead\nYou see I've been through the desert on a horse with no name\nIt felt good to be out of the rain\nIn the desert you can't remember your name\n'Cause there ain't no one for to give you no pain\nLa la la la la la...\nAfter nine days I let the horse run free\n'Cause the desert had turned to sea\nThere were plants and birds and rocks and things\nThere was sand and hills and rings\nThe ocean is a desert with its life underground\nAnd a perfect disguise above\nUnder the cities lies a heart made of ground\nBut the humans will give no love\nYou see I've been through the desert on a horse with no name\nIt felt good to be out of the rain\nIn the desert you can't remember your name\n'Cause there ain't no one for to give you no pain\nLa la la la la la...\nThank you all very much\n\n\"Are You Going to San Francisco\"\nLyrics & Music by Scott McKenzie\nPerformed by Scott McKenzie\n\nIf you're going to San Francisco\nBe sure to wear some flowers in your hair\nIf you're going to San Francisco\nYou're gonna meet some gentle people there\n\nFor those who come to San Francisco\nSummertime will be a love-in there\nIn the streets of San Francisco\nGentle people with flowers in their hair\n\nAll across the nation such a strange vibration\nPeople in motion\nThere's a whole generation with a new explanation\nPeople in motion people in motion\n\nFor those who come to San Francisco\nBe sure to wear some flowers in your hair\nIf you come to San Francisco\nSummertime will be a love-in there\n\nIf you come to San Francisco\nSummertime will be a love-in there",
