    copyright: "© EckiHag",
    title: "Portrait of Louis XIV",
    description:
      "Das Gemälde \"Porträt von Ludwig XIV.\" wurde vom französischen Maler Hyacinthe Rigaud im Jahr 1701 geschaffen. Es handelt sich um eines der bekanntesten Porträts des französischen Königs Ludwig XIV., der auch als \"Ludwig der Große\" oder \"der Sonnenkönig\" bekannt ist. Das Porträt wurde während der Regierungszeit von Ludwig XIV. gemalt und vermittelt die königliche Pracht und den absolutistischen Stil des französischen Hofes zu dieser Zeit.\nDas Porträt zeigt Ludwig XIV. in königlicher Pracht und Selbstbewusstsein. Er steht imposant und aufrecht vor einem prächtigen, roten Vorhang, der symbolisch für seine königliche Macht und Autorität steht. Ludwig XIV. trägt königliche Kleidung und ist mit reichen Verzierungen geschmückt. Er hält in seiner rechten Hand das Zepter, ein Symbol für seine Macht, und seine linke Hand ruht auf einer prächtigen, mit Gold verzierten Krone.\nDas Gesicht des Königs ist sorgfältig und detailliert gemalt, und es strahlt Selbstsicherheit und Würde aus. Sein Blick ist auf den Betrachter gerichtet, was seine Autorität und Entschlossenheit unterstreicht. Im Hintergrund sieht man einen Raum, der den Glanz des französischen Hofes widerspiegelt.\nDieses Porträt von Ludwig XIV. von Hyacinthe Rigaud ist ein herausragendes Beispiel für die barocke Porträtkunst des 17. Jahrhunderts. Es vermittelt die königliche Pracht und das Selbstverständnis des Monarchen und diente dazu, seine Macht und Autorität zu unterstreichen.\n<li><a class='liAnker' href='Portrait of Louis XIV'  target='_blank'>Portrait of Louis XIV im Getty Center</a></li>\n",
