    title: "Terassen - Aussichten",
    description:
      "Alle Gebäude, in denen sich die jeweiligen thematischen Sammlungen befinden, haben riesige Balkone, die jeweils unterschiedliche und sehr weite Sichten auf die Stadt ermöglichen, weil sich das Center auf der Spitze eines Berges verteilt. Hier eine Sicht auf die in Teilen 7-spurige Autobahn (beide Seiten = 14 Spuren!), die von Norden nach Süden führt und die wir in einem Stau im Feierabendverkehr erleben.",
    image: "./uploads/picscollection/2023-11-02_16-32-19-029fd020-7995-11ee-b5fe-719505e57d84.jpg",
    belongstosource: "isfromaplace",
