    copyright: "© EckiHag",
    title: "Two Studies of a Seated Nude with Long Hair",
    description:
      "Gustav Klimt bevorzugte eine etwas unorthodoxe Arbeitsweise: Er beschäftigte eine Reihe von Aktmodellen, die sich in seinem Atelier aufhielten und spontane Posen einnahmen, die er mit einigen wenigen, äußerst sparsamen Kreide- oder Bleistiftstrichen festhielt. Viele dieser Lebensstudien blieben eigenständige Kunstwerke, andere wiederum inspirierten ihn zu Gemälden.\n\nDiese Skizzen einer knienden Frau, deren üppiges Gesäß sich dem Betrachter entgegenstreckt und deren üppiges Haar wie von einer Luft- oder Wasserströmung erfasst um ihren Kopf fällt, dienten schließlich als Vorzeichnungen für die Vordergrundfigur in Klimts Gemälde Goldfisch (heute im Kunstmuseum Solothurn, Schweiz). Im fertigen Gemälde behält der Akt diese Pose bei, dreht aber den Kopf, um frech über die Schulter zu blicken; Klimt betitelte es ursprünglich \"An meine Kritiker\", in Anspielung auf die Kontroverse über drei hocherotische Wandgemälde, die er für die Universität Wien malte und die von der konservativen Presse angegriffen worden waren. Die fließende, stilisierte Behandlung des Körpers und der Haare des Modells, die an die Abstraktion grenzt, deutet auf seine dauerhafte Identifizierung der Frau mit dem Wasser hin - grenzenlos, immateriell und flüchtig - ein häufiges Motiv in seinem Werk.\n<li><a class='liAnker' href='https://www.getty.edu/art/collection/object/109E1R'  target='_blank'>Two studies im Getty Center</a></li>\n",
    image: "./uploads/picscollection/2023-11-02_16-33-15-240242c0-7995-11ee-b5fe-719505e57d84.jpg",
