    ord: 310,
    video: false,
    copyright: "© EckiHag",
    title: "Man with a Hoe",
    description:
      "Das Gemälde des französischen Künstlers Jean-François Millet wurde im Jahr 1860 geschaffen. Es zeigt einen bäuerlichen Arbeiter, der mit einer Hacke in der Hand inmitten eines Feldes steht. Er ist von der harten körperlichen Arbeit gezeichnet, sein Gesicht und sein Körper sind gebeugt und von Anstrengung gezeichnet. Der Bauer wirkt müde und ausgelaugt, und das Bild vermittelt eine tiefe Verbundenheit mit der Erde und der harten Arbeit, die zur Erzeugung von Nahrungsmitteln notwendig ist.\n\nDas Bild hatte erhebliche gesellschaftliche Auswirkungen, da es die harte Realität des bäuerlichen Lebens im 19. Jahrhundert darstellte. Es wurde als sozialkritische Kunst betrachtet und trug zur Sensibilisierung für die schwierigen Arbeitsbedingungen der Landarbeiter bei. Das Bild war Teil einer größeren Bewegung in der Kunst, die die soziale Ungerechtigkeit und die Ausbeutung der Arbeiterklasse thematisierte. Es trug dazu bei, das Bewusstsein für die Notwendigkeit von sozialen Reformen und die Verbesserung der Lebensbedingungen der Landarbeiter zu schärfen. \"Man with a Hoe\" bleibt ein Symbol für die harte Arbeit und die soziale Gerechtigkeit in der Kunstgeschichte.\n<li><a class='liAnker' href='https://www.getty.edu/art/collection/object/103RGZ'  target='_blank'>Man with a Hoe im Getty Center</a></li>",
