    copyright: "© EckiHag",
    title: "Irises",
    description:
      "Vincent van Gogh malte das Bild \"Schwertlilien\" im Jahr 1889, während seines Aufenthalts in der psychiatrischen Anstalt Saint-Paul-de-Mausole in Saint-Rémy-de-Provence, Frankreich. Das Gemälde zeigt eine Vase mit Schwertlilien in verschiedenen Blautönen und weißen Blüten, die in einem blauen Hintergrund stehen.\n\nVan Gogh malte dieses Bild, als er unter psychischen Gesundheitsproblemen litt, und es ist ein Beispiel für sein Meisterwerk, das trotz seines inneren Kampfes mit lebendigen Farben und dynamischem Pinselstrich leuchtet. Die Schwertlilien sind in dem Bild stark stilisiert und fast abstrakt dargestellt. Die kräftigen Blautöne verleihen dem Gemälde eine lebendige Intensität und erzeugen einen auffälligen Kontrast zum Hintergrund.\n\n\"Schwertlilien\" ist ein Beispiel für van Goghs Fähigkeit, Schönheit und Ausdruck inmitten persönlicher Herausforderungen zu schaffen. Es zeigt seine Leidenschaft für die Natur und die Blumenmotive, die in vielen seiner Werke präsent sind.\n<li><a class='liAnker' href='https://www.getty.edu/art/collection/object/103JNH'  target='_blank'>Irises im Getty Center</a></li>",
