    ord: 830,
    video: false,
    copyright: "© EckiHag",
    title: "Ronald Reagan Library",
    description:
      'Der Ort wurde uns von mehreren Seiten empfohlen, auch mit dem Hinweis: "It never minds, if you are Democrat or Republican." Schon bei der Anfahrt, eine langbezogene Bergstraße werden uns auf Plakaten die zur Zeit 47 Präsidenten der USA vorgestellt. Als wir in Deutschland Ronald Reagan kennenlernten, haben wir ihn nicht ganz ernst genommen. Tatsächlich zeigt die Ausstellung: er hat vieles bewegt, nicht zuletzt war in gutem Kontakt mit Michael Gorbatschow und damit Teil der Wende der sowjetischen Politik. Vor seiner Zeit als Präsident der USA war er auch Gouverneur von Kalifornien. Seine politische Ausrichtung war stramm neoliberal, gepaart mit einem positiven Menschenbild.\nReagan setzte sich für eine wirtschaftsliberale Politik ein, die Steuersenkungen, Deregulierung und eine Stärkung der Marktwirtschaft umfasste. Er verfolgte eine harte Linie im Kalten Krieg und stärkte die militärische Präsenz der USA. Seine Regierung betonte traditionelle Werte und konservative Gesellschaftspolitik, darunter eine ablehnende Haltung gegenüber Abtreibung und eine Betonung von Familie und Religion. Reagan wird oft mit dem Begriff "Reaganomics" in Verbindung gebracht, der seine wirtschaftlichen Ansichten und Politikmaßnahmen beschreibt.',
    image: "./uploads/picscollection/2023-11-03_01-14-57-0588b510-79de-11ee-965f-85a76c7589ac.jpg",
