    description:
      'Nachdem wir Ronald Reagan, sein Leben und seine Politik in aller Einseitigkeit und Kritiklosigkeit gesehen haben, schauen wir uns die Sonderausstellung "Auschwitz" an. Sie bietet eine gute Darstellung der Themen, wie ich sie auch in anderen Ausstellungen erlebt habe - allerdings fehlt auch hier wieder ein kritischer Blick auf die politischen Entscheidungen, wie z.B. die Frage, warum Auschwitz trotz Wissens der alliierten Staaten um die Grauen nicht bombadiert wurde.',
