    copyright: "© EckiHag",
    title: "Fortbewegung",
    description:
      "In den Städten gibt es kleine Agenturen, die alle Orte aushängen, die angefahren werden:\n<br>\nAntigua Guatemala: Diese Stadt, ein UNESCO-Weltkulturerbe, ist bekannt für ihre gut erhaltene Kolonialarchitektur, Kopfsteinpflasterstraßen und lebendige Atmosphäre.\n<br>\nTikal: Eine der beeindruckendsten archäologischen Stätten der Maya-Kultur. Tikal beherbergt beeindruckende Tempel und Pyramiden, umgeben von üppigem Dschungel.\n<br>\nLago de Atitlán: Der Atitlán-See ist von beeindruckenden Vulkanen umgeben und bietet atemberaubende Aussichten. Die umliegenden Dörfer, wie Panajachel und San Pedro la Laguna, sind kulturell reich und laden zum Erkunden ein.\n<br>\nChichicastenango: Dieser Ort ist berühmt für seinen farbenfrohen Markt, auf dem Handwerkskunst, Textilien und lokale Produkte verkauft werden.\n<br>\nQuetzaltenango (Xela): Die zweitgrößte Stadt Guatemalas bietet nicht nur eine lebendige lokale Kultur, sondern auch die Möglichkeit, Spanisch zu lernen. Um Xela herum gibt es beeindruckende Vulkane und heiße Quellen.\n<br>\nSemuc Champey: Ein Naturwunder mit türkisfarbenen Pools auf terrassenförmigen Kalksteinformationen, umgeben von üppigem Regenwald.\n<br>\nLivingston: Eine einzigartige Küstenstadt am Karibischen Meer, die durch ihre Garífuna-Kultur geprägt ist. Hier erlebt man eine andere Seite Guatemalas mit Karibikflair.\n<br>\nRio Dulce: Ein malerischer Fluss, der durch eine üppige Schlucht fließt und zu Bootsfahrten durch den Dschungel, zur Festung Castillo de San Felipe und zur Küstenstadt Livingston einlädt.\n<br>\nHuehuetenango: Eine Region mit atemberaubenden Bergen und Kaffeeplantagen. Man besucht das Hochland, um die einzigartige Kultur der indigenen Völker zu erleben.\n<br>\nPeten: Die Region Peten ist reich an Naturreservaten und archäologischen Stätten, darunter neben Tikal auch Aguateca und Yaxha.",
