    title: "Antigua",
    description:
      "Antigua Guatemala, oft einfach als Antigua bezeichnet, ist eine wunderschöne Stadt in Guatemala, die für ihre gut erhaltene Kolonialarchitektur, ihre historische Bedeutung und ihre lebendige Atmosphäre bekannt ist.\n<br>\nNachdem wir die Silvester-Nacht in Guatemla-City zugebracht haben (das war der Horror, wegen der unerträglichen Lautstärke der Silvesterfeier im Hotel) sind wir am nächsten Morgen mit Uber nach Antigua. Der Taxifahrer, so stellt sich bald heraus war ein Kollege von mir und so gab es auf der ca. einstündigen Fahrt einen regen Austausch.\n<br>\nAntigua ist von gut erhaltener kolonialer Architektur geprägt, darunter beeindruckende Kirchen, Klöster und Herrenhäuser aus dem 16. bis 18. Jahrhundert. Die Stadt wurde im Jahr 1979 zum UNESCO-Weltkulturerbe erklärt.\n<br>Wir kommen auf dem Markplatz an der mit hundert von Menschen bevölkert ist und wie sich bald herausstellt insbesondere für den Neujahrstag hier in Antigua mit ihren Familien.\n<br>\nDer Hauptplatz von Antigua, auch als Parque Central bekannt, ist ein malerischer zentraler Platz, umgeben von historischen Gebäuden, einem Brunnen und von Palmen gesäumten Gehwegen.\n<br>\nAntigua beherbergt mehrere beeindruckende Kirchen und Klöster. Die Kathedrale von Antigua, die Kirche La Merced und die Ruinen von El Carmen sind nur einige Beispiele. Bei meinem Morgenlauf durch die Stadt, habe ich alles schnell abgescannt.\n<br>Eine der charakteristischen Straßen von Antigua ist die Calle del Arco. Diese Kopfsteinpflasterstraße ist von Bögen gesäumt und bietet eine malerische Kulisse für Spaziergänge und Fotomöglichkeiten.\n<br>\nDer beeindruckende Volcán de Agua bildet eine majestätische Kulisse für die Stadt. Sein Anblick verleiht Antigua eine einzigartige Atmosphäre.",
