    description:
      "Hinter einer Mauer entdecken wir fast 50 Objekte, die hier abgestellt sind, um in der Semana Santa, der Passionswoche, für Prozessionen genutzt zu werden. Alle Feste vereint eine Tradition, die für uns schwer zu ertragen ist: zu allen Tages- und Nachtzeiten werden Böller und Knaller gezündet, die uns ständig erschreckt haben. In Guatemala haben wir Silvester, Neujahr und den Día de los Reyes erlebt. An letzterem gibt es Tänze mit Masken in der Innenstadt, aber auch die uns bekannte Tradition der Kinder, die in die Häuser gehen, um zu segnen und zu für einen guten Zweck Geld zu sammeln.",
