    title: "Tareas - Hausaufgaben spanisch",
    description:
      'Estas son las tareas para el fin de semana. La tarea es: "Describe tu fin de semana y cuéntame qué has hecho."\nViernes:\nEste fin de semana ha sido muy interesante. El último día en que tuvimos nuestras lecciones con Edwin fue el viernes. El tiempo estaba muy bueno. Después de las lecciones, necesitaba descansar, porque las expresiones de la semana fueron muy cansadas. Me acosté en la cama y tuve un buen sueño. Luego tuvimos una cita con los maestros y los alumnos de la escuela: preparamos una comida juntos y luego comimos y bebimos en buena compañía. Conocimos a una familia de Canadá que vivió por dos semanas con una familia guatemalteca. La mujer nos contó que fue una experiencia muy fascinante con una familia muy amable. Siempre había comida deliciosa, y preparaban las recetas juntos. Primero debíamos cortar los vegetales en pedazos muy pequeños. A mí me tocó cortar zanahorias, aproximadamente veinte piezas, ya que el grupo consistía de 12 a 14 personas. Cuando los vegetales estuvieron listos, fui a la cocina para ayudar a cocinar. En la cocina había una estufa que se calentaba con leña y encima había una cazuela grande. Me gustaba mucho revolver los vegetales en la sartén. Me gustaba especialmente, porque en mi juventud también teníamos una estufa de leña y siempre para mí era un gran placer encender el fuego.\n\nCuando la comida estuvo lista, nos sentamos todos en una gran mesa y saboreamos la comi-da: tortillas con vegetales y pollo. Mmm, muy rico. El estado de ánimo mejoró cada vez más, ya que bebimos mucha cerveza y por supuesto mucho whisky de Wilton. Edwin había com-prado, compartimos los costos, porque no todos querían beber alcohol. Por la noche estaba borracho como una cuba. Escuchamos música de marimba. Antonio tenía una boombox con un USB-stick y mostramos sus favoritas. No sé a qué hora me acosté, pero era muy tarde.\nPor la mañana, he escrito una parte de mis tareas.\nSábado:\nA la mañana siguiente, tenía resaca y el día estaba un poco nublado. Sin embargo, tenía al-gunas tareas administrativas en la computadora, por lo que también pude pasar bien la mañana.\nPor la tarde, al primero fue a nadar en el lago y entonces hice senderismo hacia la playa en dirección al volcán San Pedro con Cordula. Tuve algunos encuentros con familias y personas de Guatemala.\nPor la noche, Cordula cocinó una comida: pasta con puerros. Al principio, había una ensalada de tomates con cebolla. Nos sentamos un buen rato fuera de nuestra casa y más tarde vimos una serie de Netflix llamada "Culpa".\nDomingo:\nMe levanté a las cinco y luego tomé un café. Programé el programa "vocs" y formateé las fotos en "places", mi aplicación para mostrar a nuestras familias lo que hacemos aquí en Guatema-la.\nSobre las 10:30 me puse la ropa de correr, corrí por la playa hasta Gringolandia, que incluyó algo de escalada, y de nuevo a la carretera. En casa tengo dos manzanas y un panecillo.\nTuvimos a las doce un encuentro con Dominique para ir al mirador de San Juan. Al principio, nos perdimos en el camino hasta el hotel Peneleu, pero gracias a WhatsApp, pudimos en-contrar a Dominique en un café cerca del centro de San Juan. Tomamos una banana con chocolate y un café muy grande. Luego caminamos hacia el mirador. Fue una experiencia muy agradable. Dado que estábamos muy agotados, tomamos una lancha desde San Juan a San Pedro. Aquí fuimos al mercado y comimos una hamburguesa con queso.\nCansados y felices, llegamos a nuestra casa y terminamos el día con otra parte de la serie "Culpa".\n¡Listo!\nEpílogo:\nSe suponía que debía escribir el informe en tiempo presente, pero eso me parecía antinatural, así que traté de usar los tiempos correctos en una narración. \nEckhard te desea muchos saludos y un buen día. \nDesafortunadamente, no llegó a las veinte páginas, pero hice un gran esfuerzo para informar durante mi fin de semana. ¡Disculpe!\n\nHausaufgabe:\nPräteritum (pretérito perfecto simple):\nVerwende das Präteritum, um abgeschlossene Handlungen oder Ereignisse zu beschreiben, die zu einem bestimmten Zeitpunkt in der Vergangenheit stattgefunden haben.\nBeispiel: "El sábado pasado fui al cine con mis amigos" (Am letzten Samstag ging ich mit mei-nen Freunden ins Kino).\nImperfekt (pretérito imperfecto):\nNutze das Imperfekt, um Gewohnheiten, wiederholte Handlungen oder den Hintergrund einer Geschichte zu beschreiben.\nBeispiel: "Cuando era niño, siempre jugaba al fútbol los sábados" (Als ich ein Kind war, spielte ich immer samstags Fußball).\nPerfekt (pretérito perfecto compuesto):\nVerwende das Perfekt, um Handlungen zu beschreiben, die in der Vergangenheit begonnen haben und möglicherweise noch Auswirkungen in der Gegenwart haben.\nBeispiel: "He visitado a mis abuelos este fin de semana" (Ich habe meine Großeltern dieses Wochenende besucht).\nFutur (futuro simple):\nWenn du Pläne oder Absichten für das Wochenende ausdrücken möchtest, verwende das Futur.\nBeispiel: "El próximo sábado iré de excursión" (Nächsten Samstag werde ich eine Wanderung machen).\nHier ist ein einfacher Aufbau für deinen Bericht:\nEinleitung:\nNutze das Perfekt für den Einstieg und beschreibe kurz, was du am Wochenende gemacht hast.\nHauptteil:\nVerwende Präteritum und Imperfekt, um detailliert über spezifische Aktivitäten, Ereignisse und Gefühle zu berichten.\nSchluss',
