    video: false,
    copyright: "© EckiHag",
    title: "Los Nuevos Vestidos del Emperador",
    description:
      'Los Nuevos Vestidos del Emperador es un cuento clásico del autor danés Hans Christian Andersen.<br>\n<br>\nHabía una vez un emperador vanidoso que gastaba la mayor parte de su tiempo y dinero en adquirir ropa nueva. Dos astutos estafadores llegaron a la ciudad haciéndose pasar por hábi-les sastres y afirmaron poder tejer la tela más fina y hermosa que el ojo humano pudiera con-cebir. La particularidad de esta tela era que solo las personas inteligentes podrían verla; aquel-los que fueran tontos o incompetentes no podrían percibirla.<br>\n<br>\nEl emperador, temiendo ser considerado tonto, contrató a los supuestos sastres para que confeccionaran un conjunto de ropa con esta tela especial. Los estafadores hicieron como si estuvieran trabajando arduamente en telares vacíos, pero el emperador y su corte, temiendo ser considerados incompetentes, elogiaron la magnificencia de la tela que, en realidad, no veían.<br>\n<br>\nFinalmente, los sastres anunciaron que la ropa estaba lista, y el emperador, desnudo, pero creyendo que llevaba un traje invisible, desfiló por la ciudad. La multitud, también temiendo ser considerada tonta, alabó la maravilla de los nuevos vestidos del emperador. Nadie se atre-vió a admitir que no veían ninguna ropa, hasta que un niño inocente exclamó: "¡Pero si el em-perador está desnudo!"<br>\n<br>\nLa verdad se propagó y la gente comenzó a murmurar sobre la farsa. A pesar de todo, el em-perador, decidido a mantener la apariencia, continuó desfilando hasta su palacio, mientras la multitud seguía susurrando la verdad que el niño valiente había revelado.',
    image: "./uploads/picscollection/2024-01-09_23-31-34-d83e9fc0-af3e-11ee-b5da-25c064319a4b.jpg",
    belongstosource: "isfromaplace",
