    title: "Bananen",
    description:
      "Überall stehen Bananenpflanzen, die den Gärten das karibische Flair verleihen. Außerdem ist gerade Maisernte. Es gibt viele kleine Felder auch in den Bergen. Die Maiskolben werden per Hand gepflückt, auf die Grundstücke gebracht und dort wird der Mais nach einer gewissen Trockenzeit aus den Maiskolben gelöst und weiter auf offenen Flächen getrocknet.",
