    title: "Gottesdienst",
    description:
      "Auf dem Rückweg hören wir schon von weitem eine Stimme aus einem Lautsprecher, klar Gottesdienst. Der Pastor spricht sehr laut, bzw, wird durch eine Anlage verstärkt, für unsere Ohren zum Teil unangenehm bis bedrohlich. Wir werden eingeladen und befinden uns mit ca. 200 Gottesdienstteilnehmen auf einer Baustelle: die Kirche ist noch im Rohbau, was die Gemeinde nicht hindert, sie am Sonntag zu benutzen.",
