    description:
      "An vielen Stellen wird hier in der Gegend Schokolade produziert. Natürlich ohne Maschinen und nur mit simplem Handwerkszeug. Die Schokoladenbohnen werden von den Schalen befreit, gemahlen und mit etwas Milch und Orangensaft versetzt. Das Endprodukt ist für unseren Geschmack nicht überzeugend, aber eben natürlich.",
