    description:
      "Überall gibt es Straßenhunde, die auf den Wegen und Straßen herumlungern. Sehr unangenehm. Auf einem Weg zum Strand beißt mich ein kleiner Hund einfach in die Wade. Hat nicht wehgetan, zieht aber eine lange Geschichte der Impfung nach sich. Ein echtes Abenteuer. Das erzähle ich lieber mal, weil der Text etwas länger werden könnte.",
