    title: "El artista",
    description:
      "Martin Israel, in dessen Haus wir jetzt eine Woche wohnen ist von Beruf Maler. Er malt immer das gleiche Motiv: die Ansicht auf den See mit dem Hintergrund der Vulkane. Es gibt aber ansonsten kaum Arbeit hier und Martin verlässt seine Familie von Februar bis September jeden Jahres, um in Kanada die Kirschenernte vorzubereiten und dann mit vielen anderen aus San Pedro auch durchzuführen. Der Mindestlohn liegt hier bei 4000 Quetzales im Monat, was ungefähr 500 Euro entspricht, aber viele Arbeitgeber halten sich nicht daran und laut Brenda gibt es auch viele Menschen, die mit 200 Euro umgerechnet zurechtkommen müssen.",
    image: "./uploads/picscollection/2024-01-14_15-12-51-007b8ab0-b2e7-11ee-8376-99cc4d7f721b.jpg",
