    copyright: "© EckiHag",
    title: "La familia",
    description:
      "Auf dem Bild sind Brenda, Martin Israel und ihr Sohn Ajeandro sowie Sophia, unsere Mitbewohnerin zu sehen. Einen guten Teil ihres Einkommens hat die Familie seit 2 Jahren durch die Beherbergung von Schülerinnen und Schülern aus den umliegenden Sprachschulen. Alle drei sind herzlich aufgeschlossen und wunderbare Gastgeber, insbesondere auch Alejandro, der sofort die Nähe sucht und stolz auf seine Familie und ihr Haus ist.",
    image: "./uploads/picscollection/2024-01-14_15-12-59-05919300-b2e7-11ee-8376-99cc4d7f721b.jpg",
