    title: "San Marcos",
    description:
      "Mittags fahren wir mit dem Boot weiter nach San Marcos. Hier lernen wir Philip kennen, der seit einigen Jahren eine Bäckerei betreibt und der uns in einer intensiven Stunde in seine bewegende Lebensgeschichte hineinnimmt. Der Titel könnte etwa so lauten: \"Von der Zwangsadoption über den Kiffer zum mittelständischen Jungunternehmer.\" Ein Journalist hat auch schon einen Bericht über ihn geschrieben:\n<ul>\n<li><a class='liAnker' href='https://hinter-den-schlagzeilen.de/guatemala-storys-teil-1' target='_blank'>Philip 1</a></li>\n<li><a class='liAnker' href='https://hinter-den-schlagzeilen.de/guatemala-storys-teil-2' target='_blank'>Philip 2</a></li>\n<li><a class='liAnker' href='https://hinter-den-schlagzeilen.de/die-guatemala-story-teil-3' target='_blank'>Philip 3</a></li>\n</ul>",
