    title: "Katholischer Gottesdienst",
    description:
      "Am Samstagabend lande ich in einem Jugendgottesdienst in der katholischen Kirche. Ganz anders als die protestantischen Gottesdienste, die ich hier erlebt habe: ruhig und wenig aufdringlich, sehr angenehm für mich in der Stimmung und wirklich schön. Chema hat uns schon zu Beginn erzählt: die Protestanten sind hier ziemlich fanatisch. Tatsächlich ist der Protestantismus hier hin seiner pfingstlerischen Variante auch für mich gewöhnungsbedürftig. Aber ich weiß auch: es sind alles Schwestern und Brüder im Herrn.",
    image: "./uploads/picscollection/2024-01-14_15-18-06-bc4ce6d0-b2e7-11ee-8376-99cc4d7f721b.jpg",
