    video: false,
    copyright: "© EckiHag",
    title: "Aufklärung",
    description:
      'La Ilustración\n<br><br>\nLa Ilustración, también conocida como la "Aufklärung" en alemán, fue un movimiento intelectual que se desarrolló en Europa durante los siglos XVII y XVIII. Este periodo se caracterizó por la promoción de la razón, la ciencia y la libertad como medios para alcanzar la felicidad y el progreso social.<br>\n<br>\nLa Ilustración fue un movimiento intelectual que surgió en Europa durante los siglos XVII y XVIII. Se caracterizó por la promoción de la razón, la ciencia y la libertad como valores fundamentales para el progreso humano. Los ilustrados abogaban por la aplicación de la razón y el pensamiento crítico para superar la ignorancia, los prejuicios y la opresión.<br>\n<br>\nUno de los principales objetivos de la Ilustración era emancipar a la sociedad de las restricciones impuestas por la tradición, la autoridad religiosa y el absolutismo monárquico. Los filósofos ilustrados, como Voltaire, Montesquieu, Rousseau y Kant, entre otros, contribuyeron a la difusión de ideas que promovían la libertad individual, la igualdad ante la ley y la separación de poderes.<br>\n<br>\nLa Ilustración también tuvo un impacto significativo en el campo de la ciencia, fomentando el método científico y el escepticismo hacia las creencias sin fundamentos empíricos. Este movimiento sentó las bases para el surgimiento de la Revolución Industrial y para la formación de las democracias modernas.<br>\n<br>\nEn resumen, la Ilustración fue un periodo crucial que enfatizó el valor de la razón, la ciencia y la libertad como herramientas para liberar a la humanidad de la ignorancia y la opresión.',
