    ord: 810,
    video: false,
    copyright: "© EckiHag",
    title: "Cuando era un niño",
    description:
      "Cuando era niño, hablaba como un niño, pensaba como un niño y razonaba como un niño; pero cuando me hice hombre, dejé atrás las cosas de niño. Ahora vemos a través de un espejo, de manera oscura; pero entonces veremos cara a cara. Ahora conozco solo en parte; pero entonces conoceré completamente, así como también soy conocido. Ahora permanecen la fe, la esperanza y el amor, estos tres; pero el mayor de ellos es el amor. (1 Corintios 13,11)<br>\n<br>\nCuando era un niño, vivía en una granja. Mis padres tenían cerdos, vacas, pollos, patos, gansos y gatos. Mi padre tenía un negocio agrícola donde vendía alimentos para animales, fertilizantes y pesticidas. Tuve una infancia feliz porque mis padres (en su mayoría) eran buenos conmigo, había suficiente comida y bebida, y las actividades en la granja siempre eran muy interesantes. Mi hermana y mi hermano son mayores que yo. Teníamos muchos vecinos niños con los que podía jugar.<br>\n<br>\nEspecialmente disfrutaba mucho de la época de la cosecha. Era verano, la cebada estaba madura, el sol brillaba y a menudo hacía mucho calor. Luego venían las cosechadoras y a veces me dejaban subir a la cosechadora. Cuando fui mayor, conducía los remolques con el tractor hasta los campos. Era una sensación increíble cuando la cebada o el trigo salían del tubo de la cosechadora y el remolque se iba llenando poco a poco. La paja solía quedarse en el campo durante tres días. Luego venía el tío Ernst con la empacadora de paja, empacaba la paja en fajos y teníamos que recogerla. Como mi hermano Wilhelm era más grande y más fuerte que yo, él tenía que poner los fajos de paja en los remolques con la horquilla. Yo tomaba los fajos de paja y los colocaba de manera que cupiera la mayor cantidad posible en el remolque. Nuestro vecino Olaf, que era dos años más joven que yo, conducía el tractor. Cuando oscurecía, hacíamos una barbacoa bebíamos mucha cerveza, estabamos felices y satisfechos.<br>\n<br>\nAls ich ein Kind war, da redete ich wie ein Kind und dachte wie ein Kind und war klug wie ein Kind; als ich aber ein Mann wurde, tat ich ab, was kindlich war. Wir sehen jetzt durch einen Spiegel in einem dunklen Bild; dann aber von Angesicht zu Angesicht. Jetzt erkenne ich stückweise; dann aber werde ich erkennen, gleichwie ich erkannt bin. Nun aber bleiben Glaube, Hoffnung, Liebe, diese drei; aber die Liebe ist die größte unter ihnen. 1. Kor 13,11<br>\n<br>\nAls ich ein Kind war, lebte ich auf einem Bauernhof. Meine Eltern hatten Schweine, Kühe, Hühner, Enten, Gänse und Katzen. Mein Vater betrieb einen Landhandel, in dem Futter für Tiere, Düngemittel und Spritzmittel verkauft wurden. Ich hatte eine glückliche Kindheit, weil meine Eltern (meistens) gut zu mir waren, es gab genug zu essen und zu trinken und die Beschäftigung auf dem Bauernhof waren immer sehr interessant. Meine Schwester und mein Bruder sind älter als ich. Wir hatten viele Nachbarskindern, mit denen ich spielen konnte.<br>\nInsbesondere die Erntezeit hat mir immer viel Spaß gemacht. Es war Sommer, die Gerste war reif, die Sonne schien und es war oft sehr warm. Dann kamen die Mähdrescher und ich durfte manchmal auf dem Mähdrescher mitfahren. Als ich älter war, fuhr ich die Anhänger mit dem Trecker zu den Feldern. Es war ein tolles Gefühl wenn die Gerste oder der Weizen aus dem Rohr des Mähdrescher kam und der Anhänger sich nach und nach füllte. Das Stroh blieb meis-tens drei Tage lang auf dem Feld liegen. Dann kam Onkel Ernst mit der Strohpresse, presste das Stroh in Bündel und wir mussten es einsammeln. Da mein Bruder Wilhelm größer und stärker war als ich musste er die Strohbündel mit der Forke auf den Anhängen stecken. Ich nahm die die Strohbündel an und packte sie so, dass möglichst viel auf den Anhänger passten. Unser Nachbar Olaf, der noch zwei Jahre jünger war als ich fuhr dann den Trecker. Wenn es dunkel wurde, haben wir gegrillt, glücklich und zufrieden.",
