    title: "pr vs para",
    description:
      "<b>para</b><br>\ndirección - Richtung<br>\n Salieron ayer para La Habana. <br>\ndeterminación - Bestimmung<br>\n Mira. Compré esta cadena para tio.<br>\ndestinatario - Empfänger<br>\n Este regalo es para ti.<br>\nobjetivo - Ziel<br>\n Estudiamos para obtener buenas calificaciones.<br>\nintención - Absicht<br>\n Vine aquí con la intención de ayudar.<br>\ndestino - Zielort<br>\n Compramos boletos para un destino exótico.<br>\ncapacidad - Fähigkeit<br>\n El autobus es para treinta personas.<br>\ncomparación – Vergleich<br>\n Es alto para su edad.<br>\n<br><br>\n<b>por</b><br>\ncausa, razón – Ursache,Grund<br>\n Se casó con ella sólo por dinero.<br>\nubicación inexacta - ungenaue Ortsangabe<br>\n Anduvieron por toda la ciudad.<br>\n ¿Sabes dónde vive Paco? – Por el Ayuntamiento, creo.<br>\nmomento inexacto - ungenaue Zeitangabe<br>\n Por las mananas no estoy nunca en encasa.<br>\nmedio - Mittel<br>\n Enviaron los libros por avión.<br>\nen honor de – zugunsten von, für<br>\n Luchó siempre por sus derechos.<br>\nen lugar de - anstelle von<br>\n ¡Pregúntales! A lo mejor puedes firmar por él.<br>\nprecio - Preis<br>\n ¿Cuanto pagaste por esta enciclopedia?<br>\nUrheber beim Passiv<br>\n El Guernica fue pintado por Picasso.<br>",
