    title: "Frases de la semanas 3",
    description:
      'Mo. 15.1.24<br>\nla venganza de Montezuma = diarrea<br>\nla propiedad privada = Privateigentum<br>\nexpropiado = enteignet<br>\nel propietario / el dueño = Eigentümer<br>\ntenemos que trabajar más = wir müssen mehr arbeiten<br>\npor las bendiciones = wegen des Segens<br>\naquí, acá = hier<br>\nallí, allá = dort (weit entfernt)<br>\nla hija está allí = die Tochter ist hier<br>\nhimnario con notas = Gesangbuch <br>\nla predicación / el sermón = Predigt <br>\nla bandeja = Tablett<br>\nvasos para la cena del señor = Gläser für das Abendmahl<br>\nla sangre de Cristo = das Blut Christi<br>\neste pan significa el Corpus Christi = dieses Brot ist der Leib Christi<br>\nuna anécdota = eine Anekdote<br>\nel absolutismo = der Absolutismus<br>\nsecuestros = Entführte<br>\nsecuestrar = entführen<br>\nla codicia = Gier<br>\nla advertencia = Warnung<br>\nlos anuncios = Anzeigen<br>\nla determinación = Entschlossenheit<br>\nlas circunstancias = die Umstände<br>\nel objeto = das Objekt / das Ziel<br>\nla razón = die Vernunft<br>\n\nDi. 16.1.24<br>\nla razón<br>\nla vida loca = Lotterleben<br>\nEn Guatemala un autobús tiene capacidad para al menos 30 personas, en Alemania un máximo de 8 personas, pero el payaso (Clown) no encontró más espacio.<br>\nEsta mañana me desperté a las 6 de la mañana, luego me levanté y me despedí de mi esposa.<br>\nSoy feliz gracias a la vida.<br>\nYo voy al trabajo en tren / por tren (medio de transporte).<br>\nImperfecto:<br>\nCada mannnana lavaba mis dientes pero ayer no tuve tiempo.<br>\n1. Acciones habituales en el pasado.<br>\n2. Descripción en el pasado (personales, animales, lugares y cosas).<br>\n3. Acciones interrumpidas por otra acciones.<br>\nRegel: Imperfekt + cuando + pretérito<br>\nYo estaba en la piscina cuando cayó un avión del cielo.<br>\nO cuando sono la alarma.<br>\ncada día, frecuentemente ... lista de palabras para usar los tiempos<br>\nTenía 11 annnos cuando yo aprendí a conducir una moto.<br>\nEran las 2am cuando fui a mi casa.<br>\n4. Acciones simultáneos en el pasado.<br>\ncuando + imperfecto + imperfecto<br>\nmientras / cuando<br>\ncuando vuelimos a Nicaragua los otros aprendían en la escuela.<br>\nMientras dormíamos Cordula roncaba.<br>\nCuando Brenda ronca, tomo un palo y golpeo el techo.<br>\n<br>\n17.1.24<br>\nEl destruyó el sistema. ¿Cómo se convierte uno en un asesino? (asesino, asesinar, asesinado / Mörder, ermorden, Ermordeter<br>\n¿Dónde está el mercado? ¿Qué es un castillo? Todo el mundo conoce este proceso cuando tiene un recuerdo del pasado. Estos panecillos (Brötchen) son para compartir. El comportamiento (Verhalten) del niño no es bueno, está desestabilizando el sistema. El grupo no avanza. O bien Cordula cocina o yo (entweder - oder). Estoy haciendo una dieta intermitente. La cosechadora (recolectadora) recorre los campos y cosecha la cebada (Gerste). Edwin enseña a los estudiantes muchas palabras nuevas, los estudiantes aprenden con mucho esmero.<br> \'fleißig Adj (arbeitsam) trabajador, aplicado; (eifrig) asiduo  / diligente [[dili\'xente] adj (aplicado) fleißig; (ágil) flink; (esmerado) sorgfältig <br><br><br>\n\nEstamos recolectando las mazorcas de maíz restantes (verbleibende Maiskolben) del campo. No sé qué es Nemesis, ¿puedes explicármelo?<br><br>\nRaúl cuenta que sus padres lo golpearon y castigaron porque era un poco diligente (fleißig). <br><br>\n\n¿Qué significa "berinche"? En el momento de ser golpeado. El padre de Raúl era muy violento. Siempre hay un límite. Raúl cuenta la historia de un anuncio en el que un niño pequeño tiene un ataque de rabia, luego aparece el letrero (Schriftzug): con un condón eso no habría pasado.<br>\nC. dice que dejó la casa para siempre (abandonar), pero quería decir que solo sería para ir de compras. <br>\n¿Qué asignaturas (Fächer) tienen los niños en la escuela? Es una gran mentira. Los pensamientos son libres. Voy a extrañar a la gente aquí. No todo es de color rosa. El momento es muy intenso cuando no se trata solo de fotos e Instagram. El verbo "caber"  (passen) es difícil de conjugar porque es irregular. Tenemos tiempo para retener (halten, behalten) las cosas que hemos aprendido. Tarea: Escribe un discurso de despedida (zur Verabschiedung) que dure 60 minutos. Cordula tiene 20 minutos y tú tienes 40 minutos. La vida es maravillosa y un tesoro. Esta oración (frase) no es muy larga.retener. <br><br>\n\nLa confianza es buena, el control es mejor. Pero esta frase viene de un viejo aleman. "El es una bolsa vieja."<br><br>\nBeispielsätze:<br>\nPreterito<br>\nAnoche hablé con mis amigos. Ayer salí de mi casa, fue aún a un restaurante y cene.<br>\nImperfecto:<br>\nYo hablaba con mis amigo, cuando mi novia llegó. En la escuela, leyía un libro y hacía muchos tareas, porque mis profesores eran estrictos, era una escuela grande y muy bonita.<br>\n\n',
    image: "./uploads/picscollection/2024-01-18_15-03-59-6d95dc10-b60a-11ee-9060-21fd7fa1f795.jpg",
