    title: "Gottesdienst, pentecostal",
    description:
      'Brenda und Martin gehören einer neu gegründeten pfingsterlischen Gemeinde an, die gerade mal 93 Mitglieder hat. Da es noch keine Kirche gibt, wird der Gottesdienst an unterschiedlichen Stellen gefeiert. Heute vor dem Hotel eines der Gemeindeglieder, der zugleich der Finanzminister ist. Ein Pastor, mit dem ich hinterher einen intensiven Austausch habe, wird als Gastprediger eingeladen. Es wird gesungen, gebetet und vor allem zum Ende der Predigt gibt es ein pfingstlerisches Element, in dem die Gemeinde in den "Rausch des Heiligen Geistes" versetzt wird. Für uns sehr fremdartig.',
