    description:
      "Während des Waschens und Schälens wird immer wieder die 2. Qualität aussortiert. Beim Waschen in der Schüssel, sind es die Bohnen, die oben schwimmen. Die geschälten Bohnen werden direkt nach der Schälung an der Maschine sortiert. Die aussortierten Bohnen ergeben einen Kaffee, der minderer Qualität und bitterer ist.",
