    title: "Lastwagen mit Toña verstopft die Dorfstraße",
    description:
      "Tatsächlich passiert hier in unserem Camp nicht so viel, aber es ist wunderschön, leider tut es auch das Internet nur sporadisch, so dass wir uns ein bisschen wie am Ende der Welt fühlen. Da ist der wöchentliche Laster mit dem bekanntesten Bier Nicaraguas, fast schon ein Besuch aus einer anderen Welt.",
