    ord: 100,
    video: false,
    copyright: "© EckiHag",
    title: "Che Guevara",
    description:
      "Die Rückfahrt ist auf der Che Guevara: ruhige See, Sonnenschein, die Fähre nur halb voll. Welch ein Genuss!\n<br>\nDer Namen der Fähre erinnert natürlich an die Revolution der Sandinisten. General Sandino ist der großer Kämpfer für den Sozialismus und erhält deswegen auch hier und da ein Reiterstandbild. <br>\nNicaragua ist eine zentralamerikanische Republik mit einer Präsidialdemokratie. Historisch gesehen war das Land von politischer Instabilität, Bürgerkriegen und Diktaturen geprägt, aber in den letzten Jahren hat es relativ stabile politische Verhältnisse erlebt, trotz anhaltender sozioökonomischer Herausforderungen.\n<br>\nJosé Daniel Ortega Saavedra (* 11. November 1945 in La Libertad, Chontales) ist seit 2006 amtierender, inzwischen diktatorisch regierendervPräsident Nicaraguas und Vorsitzender der Frente Sandinista de Liberación Nacional (FSLN). Er ist ein ehemaliger Guerillaführer und führt seit Jahren die linksgerichtete Sandinistischen Befreiungsfront (FSLN) an, die in den 1980er Jahren die Regierung führte. Ortega wurde erstmals 2007 zum Präsidenten gewählt und wurde in den folgenden Wahlen wiedergewählt.<br>\nRosario Murillo Zambrana (* 22. Juni 1951 in Managua) ist Schriftstellerin und seit Januar 2017 Vizepräsidentin von Nicaragua. Sie ist seit 1978 Partnerin, seit 2005 Ehefrau des Präsidenten Daniel Ortega. Sie gilt als die eigentliche Macht hinter der Präsidentschaft ihres Ehemannes.<br>\nIm August 2021 wurden gegen sie und 13 weitere Angehörige des Regimes Sanktionen seitens der Europäischen Union wegen Menschenrechtsverletzungen in Nicaragua verhängt.<br>\nEs gibt viel Kritik an Ortegas Regierung wegen autoritärer Tendenzen, der Beschränkung politischer Freiheiten und einer zunehmenden Konzentration der Macht. Oppositionsparteien und Menschenrechtsorganisationen haben Bedenken hinsichtlich der Demokratie und Menschenrechtsverletzungen. Aber von innen wird jegliche Oposition unterdrückt.<br>\n<br>\nNicaragua hat mit großen wirtschaftlichen Herausforderungen zu kämpfen, darunter hohe Armut und Arbeitslosigkeit. Die politischen Spannungen und die Kontroverse um die Regierungsführung führen immer wieder zu Unruhen und Protesten, die aber meistens im Keim erstickt werden.",
    image: "./uploads/picscollection/2024-02-03_21-51-14-f814f650-c2d5-11ee-ba86-790caa493c19.jpg",
    belongstosource: "isfromaplace",
