    video: false,
    copyright: "© EckiHag",
    title: "Peter",
    description:
      "Peter bewirtschaftet die Unterkunft, er ist nicht der Besitzer. Peter ist ursprünglich aus den Niederlanden und ist in Nicaragua nach wilden Jahren gestrandet. Inzwischen ist er verheiratet und hat zwei Kinder. Er arbeitet 7 Tage die Woche. Das ist normal hier für die Menschen, die im Restaurant oder in Hotels arbeiten. In die Niederlande kann er nicht zurück, obwohl seine Eltern dort leben. Das wenige Einkommen, das er hat, lässt es nicht zu, einen Flug nach Europa zu bezahlen, geschweige denn an ein Leben im Alter zu denken. Peter ist so alt wie ich und steht für mehrere, die wir kennengelernt haben.",
