    title: "Cordula versagt am Ende",
    description:
      "Wir wandern zum Wasserfall, allerdings bleibt Cordula auf der Strecke, weil ich sie nicht tragen kann. Da hat es Ina einfacher, weil Inga sie streckenweise auf den Rücken nimmt. Als es aber wirklich steil wird, springt sie durch die Felsen wie eine Gemse. Als wir wieder unten sind, sind wir glücklich und zufrieden und besuchen das Restaurant Gloria (siehe unten). Es besteht aus einem selbst gezimmerten Hochsitz am See und auf der gegenüberliegenden Straßenseite hat es es ein kleines Häuschen inmitten des für unser Empfinden ziemlich unaufgeräumten Hofes. Das Essen ist tatsächlich nicht weiterzuempfehlen. 0 Sterne für das Essen 5 Sterne für das Ambiente mit Blick auf den See.",
