    ord: 300,
    video: false,
    copyright: "© EckiHag",
    title: 'Die "casitas" auf Ometepe und der Unterschied zwischen Maya und Inka',
    description:
      'Das Leben der Menschen hier ist sehr einfach, sie leben in einfachen Hütten, Hunde, Hühner, Schweine und Enten laufen durcheinander und die Grundnahrung besteht aus Reis, Bohnen und Bananen. Die Straßen sind oft nicht gepflastert. Hier treffen sich Pferde, Kühe, Schweine, ab und zu wird ein Stier durch die Straßen bewegt und mittels dreier Reiter und Leinen in die richtige Richtung bewegt. Sehr spannend und ungewöhnlich für uns und jede Minute wird deutlich wie hoch die Standards in Deutschland sind. Die Menschen sind relativ arm, aber haben wohl das Notwendigste zum Leben. Die Zahl der Analphabeten konnte seit der Revolution Ende der 70iger Jahre von 50 auf 10% gesenkt werden. Morgens kommen die "Primaner" in die Schule (1.-4. Klasse), nachmittags die "Sekundaner", alle höheren Klassen. Menschen, die im Tourismus arbeiten können manchmal ein bisschen Englisch, ansonsten ist es schon ganz gut, wenn man ein bisschen Spanisch kann.',
