    title: "Kakao und Yoga",
    description:
      "In diesem Restaurant wird für gesundes Leben aus Kakao und einfachen Rohstoffen geworben. Im Angebot sind Yoga und lecker Torte. Dazu gibt es Musik, die zu laut ist, hier aber wenigstens für unsere Ohren annehmlich. Die Backpacker-Mädels hängen mit ihren Laptops in der Wifi-Ecke und freuen sich über das einfache Leben in Nicaragua. Ich nutze die Yoga-Plattform am See für eine einfache Rückgymnastik, während neben mir Hippies mit Blumen im Haar, Ganzkörper-Tatoos und Plunderhosen kuscheln, dabei ist die Zeit von Woodstock doch schon lange vorbei.",
