    title: "Es war schön auf Ometepe",
    description:
      "Den Rückweg treten wir wieder gemeinsam mit Julian und Stephan an, deren Auszeit nach 3 Monaten zu Ende geht und Julian deshalb ab Montag wieder auf Arbeitssuche ist, um sich die nächste Auszeit zu verdienen. Die Überfahrt ist bei bei bestem Wetter und schauen etwas wehmütig auf unsere beiden Vulkane zurück.",
