    ord: 500,
    video: false,
    copyright: "© EckiHag",
    title: "Impfung am Bahnhof",
    description:
      'Tatsächlich gibt es einen Bahnhof in Granada aus alten Zeiten. Hier stehen noch einige Waggons aus alten Zeiten und eine tolle alte Lok. Ein Herr verschafft mir Eingang auf das Gelände und auf die Frage, ob das offensichtlich vor mir liegende Museum geöffnet hat, spricht er von Kollaboration. Erst nach der Besichtigung verstehe ich, dass ich ihm etwas Geld zustecken sollte.<br>\nIch entdecke das Museum bei meinem ersten Gang zum centro de la salud, um herauszubekommen, ob hier die 4. Impfung gegen Tollwut bekommen kann.<br>\nTatsächlich klappt das am Samstag, als Cordula in Managua ist. Ich werden in der "emergencia" aufgenommen und kann gründlich die Krankheiten der Bevölkerung im Wartesaal studieren. Nach einer längeren Befragung durch eine Ärztin, die mindestens 4 Blätter ausfüllen musste und insbesondere belustigt über meinen seltsamen Namen waren, konnte ich die Impfung im Stehen von einem (wahrscheinlich) Krankenpfleger in den Arm gedrückt bekommen. Der Krankenhausmüll wurde dann auf den Boden geworfen. Es sowieso gerade ein Putzkraft da.<br>\nIch verlasse die emergencia sehr glücklich, um einen interessanten Einblick in das Gesundheitswesen dieses Landes bereichert. Übrigens gekostet hat es nichts, die Empfangsdame erklärte mir den Grund: "Wir leben hier in einem sozialistischen Land."',
