    title: "Catedral de Granada",
    description:
      "Die Kathedrale wurde im 16. Jahrhundert gegründet und ist eines der ältesten religiösen Gebäude in Mittelamerika. Der Bau begann 1525, wurde jedoch aufgrund von Angriffen durch Piraten und Erdbeben mehrmals unterbrochen und erst im 18. Jahrhundert abgeschlossen.\nDie Kathedrale ist ein herausragendes Beispiel für die koloniale Architektur in Lateinamerika. Ihr Stil ist eine Mischung aus Barock- und Renaissance-Elementen.\nDas Gebäude besteht aus vulkanischem Gestein, das in der Region reichlich vorhanden ist. Die Fassade der Kathedrale ist im barocken Stil gestaltet und zeigt kunstvolle Schnitzereien.\nDer Innenraum der Kathedrale ist prachtvoll gestaltet und enthält zahlreiche religiöse Kunstwerke, Gemälde und Altarbilder (siehe unten). \nDie Kathedrale verfügt über einen beeindruckenden Turm, der einen Panoramablick auf die Stadt und den umliegenden Bereich bietet.",
