    ord: 10,
    video: false,
    copyright: "© EckiHag",
    title: "Managua",
    description:
      "Wir sind angekommen. Den ersten Tag in Managua fahren wir dem Linienbus in die Stadt. Nachmittags holen wir Inga und Ina am Flughafen ab. Das ist ein tolles Wiedersehen. Wir fahren dann mit dem Taxi von Managua ca. 1,5 Stunden nach El Terminal (ca. 60 km). Die letzten 17 Km sind nur Feldweg. An der Kreuzung wird der Taxifahrer noch von einigen Militärs angehalten. Während ich mit dem Soldaten einige Witze mache, wird der Taxifahrer zusehends angespannt. Er will nur weiter. unauffällig steckt der dem Soldaten einige Scheine zu.",
    image: "./uploads/picscollection/2024-02-05_00-44-55-65fc7760-c3b7-11ee-b312-adb6e434a191.jpg",
    belongstosource: "isfromaplace",
