    title: "Museo del Jade",
    description:
      "Das Jade-Museum in San José, Costa Rica, beherbergt eine große Sammlung präkolumbianischer Jadekunstwerke, die zu den größten der Welt gehört. Die Ausstellung umfasst mehr als 7.000 Jadeobjekte, darunter Schmuckstücke, Figuren, Werkzeuge und rituelle Gegenstände, die von den Völkern Costa Ricas und Mittelamerikas geschaffen wurden. Das Museum bietet auch Einblicke in die kulturelle Bedeutung von Jade für diese Zivilisationen und informiert über die Techniken der Jadeherstellung und -bearbeitung.",
