    title: "Evita",
    description:
      "\"Don't Cry for Me Argentina\" fällt mir als erstes ein, wenn ich an Argentinien denke, natürlich auch Mercedes Sosa - der Taxifahrer Lucas, der uns gestern vom Flughafen hier her gebracht hat, kennt sie noch und auch unter Jugendlichen ist sie noch bekannt. Mercedes Sosa werde ich später noch zu schreiben.<br><br>\nLucas jeden falls unsere erste Begegnung in Argentinien, fällt durch seine Ruhe und sein uns \"seltsam\" anmutendes Spanisch auf. Aber es ist das Spanisch, das hier gesprochen wird - eben anders als in Mittelamerika, zumindest in der Aussprache von manchen Worten. Lucas brieft uns für Buenos Aires und wir fühlen uns gleich wohl in diesem Land.<br><br>\nAber jetzt erst noch mal zu \"Don't Cry for Me Argentina\": It is a song recorded by Julie Covington for the 1976 concept album Evita, later included in the 1978 musical of the same name. The song was written and composed by Andrew Lloyd Webber and Tim Rice while they were researching the life of Argentine leader Eva Perón. It appears at the opening of the first and second acts, as well as near the end of the show, initially as the spirit of the dead Eva exhorting the people of Argentina not to mourn her, during Eva's speech from the balcony of the Casa Rosada, and during her final broadcast.<br><br>\nHintergründe über die bewegende Geschichte von Eva Perón gibt es \n<a class='liAnker' href='https://www.telesurenglish.net/analysis/Eva-Peron-at-the-Heart-of-Womens-Vote-in-Argentina-20141110-0041.html' target='_blank'>hier</a>\n",
    image: "./uploads/picscollection/2024-02-11_13-29-20-2e4757f0-c8d9-11ee-846a-e789113b8ed5.jpg",
