    ord: 5,
    video: false,
    copyright: "© EckiHag",
    title: "In den Cordilleren",
    description:
      "Wir überfliegen die Kordillieren, was mich an einen Roman von Karl May erinnert, den ich in meiner Jugend gelesen habe. Vielleicht kommt daher mein Interesse an Südamerika. Zumindest war es das erste Buch, dass ich aus dieser Region gelesen habe. Dazu kommt natürlich der von mir geliebte <li><a class='liAnker' href='https://de.wikipedia.org/wiki/Carlos_Castaneda' target='_blank'>Carlos Castaneda</a> und Ret Marut, ein Schriftsteller, der später als <a class='liAnker' href='https://de.wikipedia.org/wiki/B._Traven' target='_blank'>B.Traven</a> in Mexiko lebte und als anarchischer Sozial-Revolutionär lebendige Erzählungen über die harten Wirklichkeiten vieler sozialer Gruppen im damaligen Mexiko veröffentlichte.\n<br><br>\nIn den Cordilleren ist der zweite von zwei zusammenhängenden Südamerika-Romanen (der erste heißt Am Rio de la Plata), die Karl May in den Jahren 1888–1890 schrieb. Ursprünglich wurden beide Teile 1889–1891 unter dem Titel El Sendador in der Zeitschrift Deutscher Hausschatz in Wort und Bild veröffentlicht. Im Juni 1894 erfolgte die erste Buchausgabe.\n<br><br>\nDie Kordilleren bestehen aus einer komplexen Serie von Gebirgszügen, die oft parallel verlaufen und durch tiefe Täler, Flüsse und Schluchten voneinander getrennt sind. Zu den bekanntesten Kordilleren gehören:\n<br><br>\nDie Anden: Die Anden sind die längste kontinuierliche Gebirgskette der Welt und erstrecken sich über 7.000 km von Venezuela im Norden bis nach Chile und Argentinien im Süden. Sie durchziehen sieben südamerikanische Länder und beherbergen einige der höchsten Berge der Welt, darunter den Aconcagua, den höchsten Gipfel außerhalb des Himalayas.\n<br><br>\nDie Rocky Mountains: Diese Gebirgskette erstreckt sich über etwa 4.800 km von British Columbia in Kanada bis nach New Mexico in den Vereinigten Staaten. Sie sind bekannt für ihre spektakulären Gipfel, alpine Landschaften und reiche Tierwelt.\n<br><br>\nDie Sierra Nevada: Diese Gebirgskette liegt im Westen der Vereinigten Staaten, von Kalifornien bis Nevada. Da waren wir im Oktober 2023. Sie umfasst den Yosemite-Nationalpark und den Lake Tahoe und ist für ihre dramatischen Felsformationen und ihre ökologische Vielfalt bekannt.\n<br><br>\nDie Kordilleren von Zentralamerika: Diese Gebirgsketten erstrecken sich von Guatemala bis Panama und umfassen Vulkane, Regenwälder und Hochlandregionen. Sie sind für ihre Artenvielfalt und ihre kulturelle Bedeutung für indigene Völker bekannt.\n<br><br>\nDie Kordilleren sind von großer ökologischer, geologischer und kultureller Bedeutung. Sie spielen eine entscheidende Rolle für das lokale Klima, die Wasserversorgung und die biologische Vielfalt der Regionen, die sie durchziehen. Zudem sind sie für viele indigene Gemeinschaften von spiritueller und kultureller Bedeutung.",
    image: "./uploads/picscollection/2024-02-12_16-45-12-b5730500-c9bd-11ee-92b3-3faa4cc6d15b.jpg",
    belongstosource: "isfromaplace",
