    ord: 100,
    video: false,
    copyright: "© EckiHag",
    title: "Der Obelisco",
    description:
      "Der Obelisco in Buenos Aires ist eines der bekanntesten Wahrzeichen und ein markantes Symbol für die argentinische Hauptstadt. Er wurde 1936 zum Gedenken an das 400-jährige Jubiläum der Gründung der Stadt Buenos Aires erbaut. Er steht im Herzen der Stadt an der Kreuzung von zwei Hauptverkehrsadern, der Avenida 9 de Julio und der Avenida Corrientes, und ragt majestätisch in den Himmel.\n<br><br>\nMit einer Höhe von etwa 67 Metern ist der Obelisco ein Bauwerk, das die Aufmerksamkeit auf sich zieht. Seine schlanke, minimalistische Struktur besteht aus weißem Beton und ist mit verschiedenen symbolischen Inschriften verziert, die an wichtige Ereignisse in der Geschichte Argentiniens erinnern.\n<br><br>\nCordula hat in ihrem Reiseführer über Argentinien (den hat sie in Nica gefunden) gelesen, dass der Obelisco in 80 Tagen erbaut wurde. Seine beeindruckende Präsenz und seine zentrale Lage machen ihn zu einem unverzichtbaren Bestandteil der Buenos Aires Skyline und zu einem Symbol für die lebhafte und vielfältige Atmosphäre der Stadt.",
    image: "./uploads/picscollection/2024-02-12_16-45-35-c2fb11e0-c9bd-11ee-92b3-3faa4cc6d15b.jpg",
