    ord: 150,
    video: false,
    copyright: "© EckiHag",
    title: "Ecoparque",
    description:
      "Am Sonntag machen wir einer Wanderung durch den <li><a class='liAnker' href='https://buenosaires.gob.ar/vicejefatura/ambiente/ecoparque' target='_blank'>Ecoparque</a>, der direkt an die Stadt angrenzt.\n<br><br>\nNach ca. 1,5 Stunden wollen wir bei 33 Grad fast dehydriert den Park verlassen, aber einige der Wandernden sagen, dass man zum Ende zurück muss. Auf der anderen Seite des Zaunes gibt es Getränke- und Essensstände, aber die Tore sind geschlossen. Dank Cordulas couragierten Einsatz bewegt sie einen Argentinier auf der anderen Seite des Zaunes uns eine Flasche Grapefruitsaft zu holen. Das war ein Genuss. Nachdem uns drei Argentinier vormachen - wie sie den Zaun umklettern (mit der Gefahr den Krokodilen zum Opfer zu falllen) suchen wir uns eine weniger gefährliche Stelle und schaffen es den Zaun zu bezwingen.\n<br><br>\nAm nächsten Tag geht es mir nicht so gut und ich feiere krank. Wahrscheinlich habe ich einen Sonnenstich. Gott sei Dank regnet es den ganzen Tag in Strömen.",
