    description:
      "Sehr bekannt ist der Stadteil San Telmo, wo es einen riesigen Markt gibt, den wir durchstöbern, ohne etwas zu kaufen (hat alles Gewicht). Immerhin fällt mir ein lokaler Künstler auf, den ich mit dem Kauf eines Bildes unterstützen will, aber den Entschluss nicht in die Tat umsetze. Doch Cordula findet etwas für 2000 Pesos: ein selbst genähtes Kleid für Inas Barbiepuppe.",
