    copyright: "© EckiHag",
    title: "Inflation",
    description:
      "Argentinien gehört zu den 20 Ländern mit der höchsten Inflationsrate weltweit.<br>\nIm Dezember 2023 ist die Inflationsrate in Argentinien auf 211,4 Prozent gegenüber dem Vorjahresmonat angestiegen. Im Vormonat November 2023 betrug die Inflationsrate noch 160,9 Prozent. Argentiniens Inflationsrate ist im Februar 2023 zum ersten Mal über die 100 Prozent geklettert und steigt weiter.\nInflation in Argentinien wird zu einem immer größeren Problem.<br>\nCordula lacht darüber, aber die Menschen hier erleiden natürlich eine große ökonomische Krise. Immerhin helfen wir durch den Umtausch unserer Dollar einigen Menschen, das sie ihr Geld in den sicheren Hafen der US-Währung bringen können. Ha Ha. Mal humor.<br>\nDie Inflationsrate bildet Veränderungen der Kosten für einen festgelegten Warenkorb ab, der eine repräsentative Auswahl an Waren und Dienstleistungen enthält. Sie wird aus dem Verbraucherpreisindex abgeleitet. Durch die hohe Inflation muss die Zentralbank in Argentinien kontinuierlich Geld drucken, um den Haushalt zu finanzieren. Der argentinische Peso schwächt gegenüber dem US-Dollar immer weiter ab und die argentinische Staatsverschuldung erhöht sich.<br>\nVerglichen dazu sind unsere 7% in Deutschland Kindersorgen.<br>\nImmerhin sagen uns die Geldwechsler, dass es am Dienstag einen neuen Kurs gibt, der vermutlich geringer ist als der derzeitige. Der offizielle Kurs beträgt 1 US-Dollar = 850 Pesos. Der <a class='liAnker' href='https://mapandcamera.com/de/Blauer-Dollarkurs-in-Argentinien/' target='_blank'>Blue-Dollar</a>, der auf der Straße getauscht wird erbringt ca. 1050 Pesos und der MEP-Tarif ist ungefähr wie der offizielle Kurs. Es ist ziemlich schwierig für uns da erst mal durchzublicken, zumal es in den letzten drei Monaten viele Änderungen durch die Regierung gegeben hat.",
