    title: "Stadtführung",
    description:
      'Wir machen eine dreistündige geführte Tour mit Freetours auf Spanisch und stellen fest, das Spanisch unseres Führers Iwan ist uns schwer zugänglich, aber wir halten durch und verbreitern unser Wissen über Argentinien und seine Hauptstadt. Hier stehen wir auf der Avenida 9 de Julio Sie ist eine der bekanntesten Straßen in Buenos Aires und wurde zu Ehren des argentinischen Unabhängigkeitstages am 9. Juli 1816 benannt. Mit einer Breite von etwa 140 Metern ist sie laut Iwan die breiteste Straße der Welt. Cordula meint zwar "Unter den Linden" in Berlin ist breiter, glaub ich aber nicht.',
