    title: "Templo Libertad",
    description:
      "Der Templo Libertad ist die Synagoge der Congregación Israelíta de la República Argentina (Israelitische Gemeinde der Argentinischen Republik), einer der ältesten jüdischen Gemeinden in Argentinien. Er wurde im Jahr 1897 errichtet und ist ein herausragendes Beispiel für die jüdische Architektur in Buenos Aires. Das Gebäude ist im maurischen Stil gestaltet und verfügt über charakteristische Merkmale wie Kuppeln, Bögen und kunstvolle Verzierungen. Die Innenausstattung ist beeindruckend und umfasst kunstvoll gestaltete Bögen, Stuckarbeiten und Glasmalereien. Während des Zweiten Weltkriegs diente die Synagoge als Zufluchtsort für viele jüdische Flüchtlinge, die vor dem Holocaust aus Europa flohen.",
