    title: "Wer ist denn noch mal Maradona?",
    description:
      'In der Kirche hat Maradona geheiratet.<br>\nMaradona,war einer der größten Fußballspieler aller Zeiten und ein Nationalheld in Argentinien. Sein vollständiger Name war Diego Armando Maradona. Er wurde am 30. Oktober 1960 in Lanús, Buenos Aires, Argentinien, geboren und verstarb am 25. November 2020 in Tigre, Buenos Aires, Argentinien. Immer und überall ist er hier gegenwärtig.<br>\nMaradona gewann die FIFA-Weltmeisterschaft mit Argentinien im Jahr 1986 und wurde zu einem Symbol des argentinischen Fußballs. Seine berühmtesten Momente auf dem Platz umfassen das "Hand Gottes"-Tor und das "Tor des Jahrhunderts", beide erzielt im Viertelfinalspiel der WM 1986 gegen England.<br>\nAbseits des Platzes kämpfte Maradona jedoch auch mit persönlichen Problemen, darunter Drogenabhängigkeit und Gesundheitsprobleme. Trotzdem bleibt er eine Legende des Fußballs und wird in Argentinien und weltweit als einer der größten Spieler aller Zeiten verehrt.<br>\nDaneben gibt es wohl auch noch Messi (ich weiß, dass ich nichts weiß), \nLionel Messi, vollständiger Name Lionel Andrés Messi, ist auch ein argentinischer Fußballspieler, der als einer der besten Spieler aller Zeiten gilt. Er wurde am 24. Juni 1987 in Rosario, Argentinien, geboren. Messi spielte die meiste Zeit seiner Profikarriere für den FC Barcelona, bevor er im Sommer 2021 zu Paris Saint-Germain wechselte.<br>\nVon Saint-Germain habe ich einen Fußballer in Nicaragua getroffen, der mir sein Autogramm aufs Handy geschrieben hat. Wer das sehen will, kann das gerne beim nächsten Treffen im Original. Außerdem hat er einen Gruß an die Fußballnation Deutschland auf mein Handy gesprochen.',
