    ord: 540,
    video: false,
    copyright: "© EckiHag",
    title: "Alberto Nismann - im Geflecht von Intrigen und Verschwörungen",
    description:
      "Das Jüdische Gemeindezentrum AMIA (Asociación Mutual Israelita Argentina) in Buenos Aires war ein bedeutendes kulturelles und soziales Zentrum der jüdischen Gemeinschaft Argentiniens.<br>\nDie AMIA erlangte traurige Berühmtheit aufgrund eines schlimmen Terroranschlags, der sich am 18. Juli 1994 ereignete. An diesem Tag wurde das AMIA-Gebäude von einem Bombenanschlag erschüttert, bei dem 85 Menschen getötet und mehr als 300 verletzt wurden. Der Anschlag war der schwerste terroristische Akt in der Geschichte Argentiniens und wird bis heute nicht vollständig aufgeklärt.<br>\nAlberto Nisman war als Staatsanwalt entschlossen, die Verantwortlichen zur Rechenschaft zu ziehen und die Hintergründe des Anschlags aufzudecken. Nisman untersuchte auch mutmaßliche Verbindungen zwischen dem AMIA-Anschlag und dem Anschlag auf die israelische Botschaft in Buenos Aires im Jahr 1992.<br>\nAus der Veröffentlichung von Depeschen US-amerikanischer Botschaften durch Wikileaks ging hervor, dass Nisman während seiner Arbeit enge Kontakte zur US-Botschaft und zur CIA hatte. Er erhob 2013 Anklage gegen mehrere Vertreter der iranischen Regierung. Die iranische Regierung lieferte die beschuldigten Staatsbürger jedoch nicht aus. Deshalb verhandelte der damalige argentinische Außenminister Timerman mit dem Iran ein, danach nicht in Kraft getretenes, Abkommen. Es sollte Nisman ermöglichen, die Beschuldigten im Iran zu befragen und sah die Einsetzung einer gemeinsamen „Wahrheitskommission“ vor. In seiner Anklageschrift von 2015] beschuldigte er daraufhin die damalige argentinische Präsidentin Cristina Fernández de Kirchner und andere hochrangige Funktionäre, dass sie die Aufklärung des Terrorattentates zu verhindern versuchten.<br>\nIm Januar 2015 Alberto Nisman, einen Tag vor der Anhörung wurde Nismann tot in seiner Wohnung in Buenos Aires aufgefunden. Sein Tod löste weitreichende Kontroversen und Spekulationen über die Umstände seines Ablebens aus und führte zu einer weiteren Aufmerksamkeit für den ungelösten Fall des AMIA-Anschlags.<br>\nTatsächlich sind die Hintergründe des Anschlags bis heute nicht geklärt worden.",
