    copyright: "© EckiHag",
    title: "Lluís Companys i Jover",
    description:
      "Lluís Companys i Jover war ein spanischer Politiker und Anwalt, der von 1934 bis 1940 Präsident der Generalitat de Catalunya war, der Regierung der autonomen Region Katalonien in Spanien. Er wurde 1882 in Tarragona, Katalonien, geboren und wurde ein prominenter Führer der katalanischen Unabhängigkeitsbewegung während der Zeit der Zweiten Spanischen Republik. Companys' Amtszeit als Präsident war von politischen Spannungen und dem Ausbruch des Spanischen Bürgerkriegs geprägt. Nach dem Krieg wurde er von den Franquisten gefangen genommen, vor Gericht gestellt und schließlich 1940 hingerichtet. Lluís Companys wird von vielen als Symbol des katalanischen Widerstands gegen die Unterdrückung durch die Franco-Diktatur angesehen und genießt auch heute noch in Katalonien große Anerkennung.",
