    title: "Basílica Nuestra Señora del Pilar",
    description:
      "Die Geschichte der Basílica del Pilar reicht bis ins 17. Jahrhundert zurück. Die ursprüngliche Kirche wurde im Jahr 1732 erbaut, aber das heutige Gebäude stammt aus dem Jahr 1876, als es nach einem Brand im Jahr 1871 wieder aufgebaut wurde. Die Architektur der Basilika ist eine Mischung aus barocken und neoklassizistischen Stilen und zeichnet sich durch ihre beeindruckende Fassade, hohe Türme und kunstvolle Verzierungen aus.",
