    copyright: "© EckiHag",
    title: "Mafalda",
    description:
      "Mafalda ist ein sechsjähriges argentinisches Mädchen, das sich für soziale Gerechtigkeit, Menschenrechte, Frieden und Demokratie einsetzt. Sie wird oft in humorvollen Situationen dargestellt, in denen sie mit politischen und sozialen Themen konfrontiert wird, die auch Erwachsene betreffen. Mafalda und ihre Freunde diskutieren über aktuelle Ereignisse, Politik, Gesellschaft und die Welt um sie herum, wodurch die Comics eine tiefe soziale und politische Relevanz haben.\nQuino - ihr Erfinder - ließ Mafalda in der Stadt Buenos Aires aufwachsen, und ihre Geschichten spiegeln oft die sozialen und politischen Umbrüche wider, die Argentinien und die Welt in den 1960er und 1970er Jahren erlebten. Trotz ihrer Entstehung vor mehr als einem halben Jahrhundert sind die Themen, die in den Mafalda-Comics behandelt werden, immer noch aktuell und relevant.<br>\nSie sind beliebt bei Menschen jeden Alters, die ihre humorvolle, aber tiefgründige Art zu schätzen wissen, komplexe Themen zu behandeln.",
