    title: "Gold und Silber",
    description:
      'Die Entdeckung des Río de la Plata, eines der größtenFlüsse Südamerikas, wird auf die erste Expedition des spanischen Entdeckers Juan Díaz de Solís im Jahr 1516 zurückgeführt. Solís war im Auftrag der spanischen Krone unterwegs, um einen Seeweg nach Asien zu suchen. Stattdessen erreichte er jedoch die Mündung des Río de la Plata.<br>\nSolís und seine Mannschaft landeten in der Nähe des heutigen Montevideo, Uruguay, und erkundeten das Gebiet um den Fluss. Während dieser Expedition stieß Solís auf einheimische Stämme, die Guaraní genannt wurden. Leider endete die Expedition tragisch, als Solís von den Ureinwohnern getötet wurde. Einige Berichte besagen, dass er von ihnen verspeist wurde, was zu der Legende führte, dass der Río de la Plata das "Silberfluss" (spanisch: Río de la Plata) genannt wurde, weil die Spanier glaubten, dass das Land reich an Silber sei.<br>\nTatsächlich hat Buenes Aires einen Teil seiner Entstehung des Gerüchtes von Gold und Silber im Rio de la plata und seiner Arme zu verdanken. Was wurde gefunden? Nichts.\nBildrechte: By Kmusser - Own work, Elevation data from SRTM, drainage basin from GTOPO [1], all other features from Vector Map., CC BY-SA 3.0, https://commons.wikimedia.org/w/index.php?curid=11713483\nDer Rio de la Plata erscheint braun, weil er viel Sediment und Schwebstoffe aus den umliegenden Flüssen mitführt, insbesondere aus dem Paraná und dem Uruguay. Diese Sedimente stammen von Erosionen entlang der Flussufer und dem Boden der Einzugsgebiete.',
