    copyright: "© EckiHag",
    title: "Cementerio de la Recoleta",
    description:
      "Der Cementerio de la Recoleta in Buenos Aires ist eine für unsere Empfindungen außergewöhnliche Ruhestätte. Errichtet im 19. Jahrhundert, beherbergt der Friedhof die Gräber vieler prominenter Persönlichkeiten, darunter Politiker, Schriftsteller, Künstler und Militärführer und damit gibt es viele Geschichten, die uns bei der Führung erzählt werden.<br>\nDer Spaziergang durch die mit marmorverzierten Gassen des Friedhofs gleicht einer Reise durch die Geschichte Argentiniens. Die Mausoleen sind kunstvoll gestaltet und spiegeln oft den Reichtum und die Bedeutung der Verstorbenen wider. Das bekannteste Mausoleum ist natürlich das von Eva Perón und der Familie Duarte.",
    image: "./uploads/picscollection/2024-02-16_14-40-13-e95f12d0-ccd0-11ee-a12a-8d5de6b45ae6.jpg",
    belongstosource: "isfromaplace",
