    video: false,
    copyright: "© EckiHag",
    title: "Salvador María del Carril, Geschichte einer Ehe",
    description:
      "Ein gigantisches Mausoleum erinnert an das Leben von Salvador María del Carril, einer wichtigen Figur in den Anfängen der argentinischen Geschichte. Geboren in San Juan im Jahr 1798, studierte Del Carril Jura und zog nach Buenos Aires, um an der nationalen Politik teilzunehmen. Er unterstützte fest Präsident Rivadavia und ermutigte General Juan Lavalle, seinen Jugendfreund Manuel Dorrego zu erschießen, in der Hoffnung, damit einen Bürgerkrieg zu verhindern. Das gelang nicht.\n<br><br>\nDel Carril lebte während der Rosas-Ära in Uruguay und traf dort seine Frau, Tiburcia... 25 Jahre jünger als er.  Bekannt ist er für seine großen Eheprobleme. Tiburcia gab anscheinend gerne Del Carrils Vermögen aus... bis zu einem Punkt, an dem er in mehreren großen Zeitungen einen Brief veröffentlichte, in dem er erklärte, dass er nicht länger für die Schulden seiner Frau verantwortlich sein werde. Das kam bei Tiburcia offensichtlich nicht gut an: Daraufhin schickte sie ihm einen Brief, in dem sie ihm erklärte, fortan nicht mehr mit ihm zu sprechen und das hielt sie dann auch für den Rest ihres Lebens ein.\n<br><br>\nGerüchten zufolge soll Tiburcia kurz vor ihrem Tod im Jahr 1898 - fünfzehn Jahre nach ihrem Mann - verlangt haben, dass ihr Büste sich für die Ewigkeit von Del Carril abwenden solle.\n<br><br>\n So sieht man - solange der Stein hält das unglückliche Paar den Rücken zueinander gekehrt. Auf dem Bild ist die Büste der Frau zu sehen und in ihrem Rücken ihr Mann, der in einem Sessel sitzt.\n",
