    ord: 230,
    video: false,
    copyright: "© EckiHag",
    title: "Rufina Cambacérès - lebendig begraben",
    description:
      'Rufina Cambacérès wurde in eine wohlhabende Familie hineingeboren, Erben eines großen Rinderreichtums, und ihr Vater Eugenio Cambacérès war ein bekannter Schriftsteller und Politiker. Rufina erlitt eine frühe Tragödie, als ihr Vater an Tuberkulose starb, als sie erst vier Jahre alt war.\n<br><br>\nIm Jahr 1902 war Rufina neunzehn Jahre alt und zu einer schönen jungen Frau herangewachsen, und gewissermaßen eine Gesellschaftsdame von Buenos Aires. Während sie sich darauf vorbereitete, eine Show zu besuchen, brach Rufina plötzlich und ohne Vorwarnung auf den Boden zusammen. (Viele moderne Versionen dieser Geschichte enthalten einiges über eine skandalöse Enthüllung, etwas über ihren Freund, der angeblich mit seiner eigenen Mutter geschlafen hat, aber dies ist fast sicher eine spätere Hinzufügung, um die Geschichte aufzupeppen.) Ärzte wurden gerufen, und angeblich stellten alle drei Ärzte fest, dass die junge Rufina an einem Herzinfarkt gestorben sei. Rufina wurde in einen Sarg gelegt und in ihrem Mausoleum versiegelt, und es fand eine Beerdigung statt.\n<br><br>\nEin paar Tage nach der Beerdigung fand ein Friedhofsarbeiter heraus, dass der Sarg sich innerhalb der Krypta bewegt hatte und der Deckel an einigen Stellen gebrochen war. In der Furcht vor Leichendiebstahl öffnete er ihn und fand etwas noch Schlimmeres - Kratzspuren, die die Innenseite des Sarges bedeckten, und Rufina tot, Hände und Gesicht gezeichnet von dem Versuch, sich aus dem Sarg zu befreien.\n<br><br>\nDie Erklärung, die Ärzte später gegeben haben sollen, ist, dass Rufina einen Anfall von "Katatonie" erlitten habe (die klassische Diagnose für das vorzeitige Begrabenwerden, und die in Edgar Allan Poes "Die vorzeitige Bestattung" verwendet wird) und später in ihrem Sarg aufgewacht sei, nur um an Erschöpfung und Schock zu sterben.\n<br><br>\nSo geht die Legende. Die Geschichte hat alle Anzeichen einer urbanen Legende, und da es äußerst schwierig ist, Beweise zu finden, die sie unterstützen, ist sie höchstwahrscheinlich unwahr. Was tatsächlich mit Rufina passiert ist, lässt sich schwer bestimmen, obwohl sie im Alter von neunzehn Jahren gestorben ist, und der Teil über einen Friedhofsarbeiter, der ihren Sarg bewegt und gebrochen findet, möglicherweise ebenfalls wahr ist. Der Rest ist wahrscheinlich das Ergebnis überaktiver lokaler Vorstellungskraft.\n<br><br>\nIhr Grabmal ist ein atemberaubendes Meisterwerk des Jugendstils und zeigt eine lebensgroße Statue von Rufina, die die Tür zu ihrem eigenen Mausoleum hält, angeblich von ihrer Mutter als Tribut an das, was ihr widerfahren ist, erbaut.',
