    video: false,
    copyright: "© EckiHag",
    title: "Desmadres. Bilder des Chaos",
    description:
      "<a class='liAnker' href='http://centroculturalrecoleta.org/agenda/desmadres-imagenes-del-desborde' target='_blank'>Desmadres</a>\nDie Ausstellung \"Desmadres. Bilder der ungehörigen Benehmens / Ausschweifung  / Chaos\" besteht aus 50 grafischen Werken von 50 lateinamerikanischen Künstlern, die aus Fragmenten von Werken von 50 lateinamerikanischen Schriftstellern geschaffen wurden. Jeder Künstler arbeitete mit einem Text, um eine Illustration im Posterformat zu erstellen. Es werden 50 illustrierte Poster und gezeigt, die mittels des \"Paste-up\", einer Technik der Straßenkunst, aufgebaut sind, die auf der Komposition von Bildern und Texten auf einer Oberfläche basiert, um sie dann auf eine Struktur zu kleben.\n<br><br>\nDie Poster sind im Raum unordentlich und chaotisch angeordnet, was eine spielerische Installation schafft, in der die Zuschauer erraten können, zu welchem Text jede Illustration gehört, und umgekehrt. Außerdem gibt es QR-Codes im Raum, um die Illustrationen anzusehen und die vollständigen Texte digital zu lesen/hören.\n<br><br>\nDie Ausstellung ist als Übersetzung des städtischen Raums gedacht, in dem Botschaften und Bilder eine Sinngebung durch Überlagerung, unordentliche Wiederholung, Überfluss und Konvergenz des Verschiedenen finden. Auf diese Weise wird das Chaos als etwas Produktives, als eine Möglichkeit des Zugangs zum Sinn, wertgeschätzt.",
    image: "./uploads/picscollection/2024-02-16_14-47-57-fe0e8660-ccd1-11ee-a12a-8d5de6b45ae6.jpg",
