    title: "Dulce de Leche",
    description:
      '"Zucker und Milch" ist ein weiteres Nationalgericht aus Argentinien.\nbrauchen dafür nur einige Zutaten.\n\nZutaten\n\n1 Liter Vollmilch\n300 Gramm Zucker\n1 Löffel Vanilleextrakt oder Vanillepulvereine Prise Natron\n\nZubereitung\n\nWir stellen einen kleinen Topf mit Teflonbeschichtung auf den Herd, fügen die Milch und gleich darauf den Zucker hinzu.Wir erhitzen die Masse bei schwacher Flamme und verrühren sie ununterbrochen mit einem Holzlöffel. Dann fügen wir die Vanille und einen halben Kaffeelöffel Natron hinzu.Wir rühren weiter, bis die Milch zu kochen beginnt; dann rühren wir noch solange weiter, bis unsere Milchcreme eine goldgelbe Farbe annimmt.Bei mittlerer Hitze den Dulce de Leche stets weiter kochen lassen, bis die Creme die zähflüssige Konsistenz einer Toffeemasse hat. Je länger unsere Creme auf dem Herd bleibt, desto fester wird sie.Hat der Dulce de Leche die gewünschte Cremigkeit erreicht, können wir ihn zu Gebäck, auf Eiscreme oder zur Füllung und Verfeinerung von Torten oder Halbgefrorenem servieren.',
