    ord: 630,
    video: false,
    copyright: "© EckiHag",
    title: "Plaza de Mayo",
    description:
      "Madres de Plaza de Mayo („Mütter des Platzes der Mairevolution“) so heißen die argentinischen Frauen, deren Kinder unter der Militärdiktatur von 1976 bis 1983 unter zunächst ungeklärten Umständen „verschwanden“ (Desaparecidos).Während der Militärdiktatur konzentrierte sich ihr Protest zunächst darauf, die Freilassung von Verhafteten oder Informationen über deren Verbleib einzufordern. Danach setzten sich die Madres de Plaza de Mayo für eine strafrechtliche Aufarbeitung der in der Diktatur begangenen Menschenrechtsverletzungen ein und engagieren sich seitem durch öffentliche Märsche an jedem Donnerstag für ein Gedenken an die Opfer.\n<br><br>\nErst nach und nach stellte sich heraus, dass das systematische, geheimgehaltene Verschwindenlassen politischer Gegner ein Teil des so genannten schmutzigen Krieges (Guerra Sucia) des Militärs war. Nach dem Übergang zur Demokratie zeigte sich auch in offiziellen Untersuchungen, dass auf diese Weise bis zu 30.000 Menschen ermordet worden waren.\n<br><br>\nDie Mütter gehören – gemeinsam mit den Abuelas de Plaza de Mayo (Großmütter der Plaza de Mayo) – zu den wenigen Menschen in Argentinien, die dagegen öffentlich protestierten. Sie gerieten dadurch selbst in Gefahr, so verschwand ihre erste Vorsitzende, Azucena Villaflor, ebenfalls spurlos.\n<br><br>\nAmnestiegesetze und Gnadenerlasse schützten die Militärs. Diese Gesetze wurden während der Amtszeit des von 2003 bis 2007 regierenden Präsidenten Néstor Kirchner aufgehoben und durch das argentinische Verfassungsgericht für verfassungs- und völkerrechtswidrig und somit für nichtig erklärt. Während der Präsidentschaft Kirchners verzichteten die Madres auf ihre wöchentlichen Märsche, die sie aber wieder aufnahmen nachdem der Nachfolger Kirchners die Verbrechen der Militärdiktatur relativiert hatte.",
    image: "./uploads/picscollection/2024-02-17_13-06-29-fb9ed4f0-cd8c-11ee-903d-a3c5116085bf.jpg",
    belongstosource: "isfromaplace",
