    copyright: "© EckiHag",
    title: "Museo del Bicentenario",
    description:
      "<a class='liAnker' href='https://www.argentina.gob.ar/secretariageneral/museo-del-bicentenario' target='_blank'>Museo del Bicentenario</a>\nIn diesem Museum werden zwei Jahrhunderte argentinischer Geschichte dargestellt. Dies geschieht insbesondere durch Bilder von Präsidenten, deren Schreibtische und manchmal auch deren Anzüge. Einige Ausstellungstücke sind interessant, aber es fehlt vor allem eine angemessene und kritische Darstellung der Militärdiktatur.",
    image: "./uploads/picscollection/2024-02-17_13-06-44-0488a190-cd8d-11ee-903d-a3c5116085bf.jpg",
    belongstosource: "isfromaplace",
