    description:
      "1982 gab es einen nicht erklärten Krieg zwischen Argentinien und Großbritannien um die Falklandinseln der ca. 3 Monate andauerte. Anfangs vom argentinischen Angriff überrascht, konnte Großbritannien die Inseln zurückerobern. In Argentinien führte der Ausgang des Krieges zum Sturz der Militärjunta und zur Wiederherstellung des demokratischen Systems. Insgesamt waren etwa 900 Tote zu beklagen.",
