    description:
      "Nach unserer Museumstour machen wir einen Spaziergang durch die Avenida Corrientes (eine Einkaufstraße mit vielen vielen Geschäften), halten ein Schnack mit einer deutschen Familie und gehen Abends mit Till (ein Austauschstudent in Santiago de Chile) essen. Wir hören viel über Chile, das ja eigentlich auch auf unserer Reise geplant war, auch begeisterte Erzählungen von Brasilien und Patagonien. Mal sehen, was für uns noch möglich ist.",
