    ord: 100,
    video: false,
    copyright: "© EckiHag",
    title: "Grenzübergang",
    description:
      'Die Abfertigungshalle ist organisiert wie auf dem Flughafen. Aber es ist alles sehr einfach: nachdem die argentinische Grenzbeamtin uns "entlassen" hat geht sie mit uns zum uruguayischen Schalter und bittet die Kollegin auch ihren Stempel in den Reisepass zu setzen. Das wars. Vor dem Gate warten schon ca. 1000 andere Leute. Das haben wir so nicht erwartet. Und trotzdem lief alles wie geschnitten Brot. Mit ca. 70km/h sind wir schnell auf der anderen Seite.',
    image: "./uploads/picscollection/2024-02-20_11-08-01-ede88160-cfd7-11ee-a82a-ef0b32e20f56.jpg",
