    title: "Uruguay ",
    description:
      "Uruguay ist etwa halb so groß wie Deutschland und hat rund 3,5 Millionen Einwohner.<br>\nDie Hauptstadt von Uruguay ist Montevideo, welche auch die größte Stadt des Landes ist.  Die Amtssprache von Uruguay ist Spanisch. Uruguay ist eine repräsentative demokratische Republik. Die Wirtschaft Uruguays ist vorwiegend auf Landwirtschaft, Viehzucht und Dienstleistungen ausgerichtet. Wichtige landwirtschaftliche Produkte sind Rindfleisch, Soja, Milchprodukte und Reis.  Die offizielle Währung von Uruguay ist der Uruguayische Peso (UYU). Der Großteil der Bevölkerung Uruguays gehört der römisch-katholischen Kirche an, obwohl das Land auch eine bedeutende Anzahl von Nichtreligiösen und Menschen anderer Glaubensrichtungen hat. Uruguay wird oft für seine hohe Lebensqualität gelobt. Es hat ein fortschrittliches Sozialsystem, ein starkes Bildungssystem und eine vergleichsweise niedrige Kriminalitätsrate.  Uruguay hat einige bemerkenswerte Naturschönheiten, darunter kilometerlange Sandstrände entlang der Atlantikküste, malerische Hügellandschaften im Landesinneren und den beeindruckenden Río de la Plata, der das Land von Argentinien trennt.",
