    title: "Drew und Carolin",
    description:
      "Drew und Carolin kommen aus Australien aus der Nähe von Sydney. Wir sind schnell in Kontakt und teilen viele Gemeinsamkeiten, die beiden sind auch fast 3 Tage in Colonia, so dass wir uns verabreden können. Da die beiden weit gereist sind, haben wir vieles auszutauschen, daneben sind natürlich auch die Kinder und Kindeskinder mit ihren Geschichten interessant.  Drew und Caroline fahren weiter nach Patagonien und werden dort 3 Wochen in den Gewässern der Antarktis verbringen. Schöne Aussichten aber kalt, ihre Koffer sind voll mit warmen Sachen.",
