    copyright: "© EckiHag",
    title: "Uruguay als Vorbild",
    description:
      'Uruguay gilt als Vorbild des heute zur Abstimmung im Bundestag vorgelegten Gesetzes zur Cannabis-Legalisierung. >>Uruguay war 2013 das erste Land der Welt, das die Herstellung, den Verkauf und den Konsum von Marihuana legalisiert hat. Das Ziel: Schwarzmarkt und Kriminalität eindämmen. Ist das gelungen?\r\n<br><br>\r\n"Einer muss ja den Anfang machen", sagte Uruguays linker Präsident José Mujica, kurz bevor sein Land einen weltweit einzigartigen Schritt in der Drogenpolitik unternahm. Anbau, Verkauf und Konsum von Marihuana sollten unter staatlicher Aufsicht legal werden.Mujica erklärte damals: "Wenn wir Marihuana legalisieren, dann zerstören wir den Schwarzmarkt. Denn wir werden die Drogen viel billiger verkaufen als die kriminellen Banden. Und in medizinischer Hinsicht haben wir einen besseren Überblick über die Konsumenten und können besser aufklären."<< zitiert nach Tagesschau (https://www.tagesschau.de/ausland/amerika/uruguay-cannabis-legalisierung-100.html)',
