    ord: 1600,
    video: false,
    copyright: "© EckiHag",
    title: "Gracias a la vida",
    description:
      'Nie habe ich sie und ihr Lied vergessen: Mercedes Sosa.\r\n<br><br>\r\nMercedes Sosa ist immer noch als "Die Stimme Lateinamerikas" bekannt. Sie wurde 1935 geboren und verstarb 2009. Sosa war eine Ikone der lateinamerikanischen Musik und eine prominente Figur in der argentinischen Musik-Szene.\r\n<br><br>\r\nIhre Musik war geprägt von politischem Engagement und sozialer Sensibilität. Sie sang über Themen wie soziale Gerechtigkeit, Menschenrechte und die Erfahrungen der einfachen Leute. Sosas kraftvolle Stimme und ihre eindringlichen Interpretationen machten sie zu einer inspirierenden Figur für viele, die nach Veränderung und Gerechtigkeit strebten.\r\n<br><br>\r\nSosa war auch eine politische Aktivistin und spielte eine wichtige Rolle während der turbulenten Zeiten in Argentinien, besonders während der Zeit der Militärdiktatur. Sie setzte sich öffentlich für die Rechte der Unterdrückten ein und wurde deshalb oft zur Zielscheibe von Zensur und Repression.\r\n<br><br>\r\nSo war sie eine kulturelle Ikone und eine Stimme für die Unterdrückten und Benachteiligten in Lateinamerika, deren Musik und Engagement bis heute inspirieren und berühren.\r\n<br><br>\r\nGracias a la vida, que me ha dado <br>\r\nMe dio dos luceros que cuando los abro<br>\r\nPerfecto distingo lo negro del blanco<br>\r\nY en el alto cielo su fondo estrellado<br>\r\nY en las multitudes el hombre que yo amo<br>\r\n<br><br>\r\nGracias a la vida, que me ha dado tanto<br>\r\nMe ha dado el oído que en todo su ancho<br>\r\nGraba, noche y día, grillos y canarios<br>\r\nMartillos, turbinas, ladridos, chubascos<br>\r\nY la voz tan tierna de mi bien amado<br>\r\n<br><br>\r\nGracias a la vida, que me ha dado tanto<br>\r\nMe ha dado el sonido y el abecedario<br>\r\nCon él las palabras, que pienso y declaro<br>\r\nMadre, amigo, hermano y luz alumbrando<br>\r\nLa ruta del alma del que estoy amando<br>\r\n<br><br>\r\nGracias a la vida, que me ha dado tanto<br>\r\nMe ha dado la marcha de mis pies cansados<br>\r\nCon ellos anduve ciudades y charcos<br>\r\nPlayas y desiertos, montañas y llanos<br>\r\n<br><br>\r\nGracias a la vida, que me ha dado tanto<br>\r\nMe dio el corazón que agita su marco<br>\r\nCuando miro el fruto del cerebro humano<br>\r\nCuando miro el bueno tan lejos del malo<br>\r\nCuando miro el fondo de tus ojos claros<br>\r\n<br><br>\r\nGracias a la vida, que me ha dado tanto<br>\r\nMe ha dado la risa y me ha dado el llanto<br>\r\nAsí yo distingo dicha de quebranto<br>\r\nLos dos materiales que forman mi canto<br>\r\nY el canto de ustedes que es el mismo canto<br>\r\nY el canto de todos que es mi propio canto<br>\r\n<br><br>\r\nGracias a la vida, que me ha dado tanto<br>\r\n<br><br>\r\n<strong>Danke an das Leben</strong><br>\r\nDanke an das Leben, das mir so viel geschenkt hat.<br>\r\nEs gab mir zwei Sterne die, wenn ich sie öffne,<br>\r\nMich perfekt Schwarz von Weiß unterscheiden lassen<br>\r\nUnd am hohen Firmament die Sterne erkennen lassen<br>\r\nUnd in der Menge den Mann, den ich liebe<br>\r\n <br><br>\r\nDanke an das Leben, das mir so viel geschenkt hat.<br>\r\nEs gab mir das Gehör, durch dessen Bandbreite mir<br>\r\nNachts der Gesang der Grillen und tags der der Kanarienvögel eingeht<br>\r\nHämmer, Turbinen, Hundegebell und Wolkenbrüche<br>\r\nUnd die zärtliche Stimme meines Liebsten<br>\r\n <br><br>\r\nDanke an das Leben, das mir so viel geschenkt hat.<br>\r\nEs schenkte mir den Klang und das Alphabet,<br>\r\nMit dem ich Worte denken und äußern kann,<br>\r\nwie Mutter, Freund, Bruder<br>\r\nUnd das Licht, das den Pfad der Seele dessen erleuchtet,\r\nDen ich liebe.\r\n <br><br>\r\nDanke an das Leben, das mir so viel geschenkt hat.<br>\r\nEs gab mir den Gang meiner müden Füße<br>\r\nMit denen ich Städte und Pfützen durchschritt<br>\r\nStrände und Wüsten, Gebirge und Ebenen<br>\r\nUnd dein Haus, deine Straße und deinen Hof<br>\r\n <br><br>\r\nDanke an das Leben, das mir so viel geschenkt hat.<br>\r\nEs gab mir das Herz, das mir höher schlägt,<br>\r\nWenn ich die Früchte des menschlichen Gehirns betrachte,<br>\r\nWenn ich das Gute sehe, so weit weg vom Schlechten,<br>\r\nWenn ich auf den Grund deiner klaren Augen sehe<br>\r\n <br><br>\r\nDanke an das Leben, das mir so viel geschenkt hat.<br>\r\nEs gab mir das Lachen und es gab mir das Weinen<br>\r\nSo kann ich das Glück vom Leid unterscheiden<br>\r\nDie beiden Stoffe, die mein Lied formen<br>\r\nUnd euer Gesang ist der gleiche Gesang<br>\r\nWie der Gesang aller mein eigener Gesang ist.<br>\r\n<br><br>\r\nDanke an das Leben, das mir so viel geschenkt hat.<br>\r\naus: https://lyricstranslate.com',
