    description:
      "Nach einem ziemlich langen Strandspaziergang mit dem Ziel das von Carlos Páez Vilaró erschaffene Dorf <a class='liAnker' href='https://casapueblo.com.uy/' target='_blank'>Casa Pueblo</a> zu besuchen, finden wir einen faszinierenden Ort an einer Steilküste in Punta Ballena gelegen. Zu Beginn des Projektes gab es hier nur Felsen und karge Landschaft. Die Bilder auf der <a class='liAnker' href='https://casapueblo.com.uy/' target='_blank'>website</a>zeigen den Entstehungsprozess.",
