    description:
      "<a class='liAnker' href='https://www.artnet.com/artists/carlos-p%C3%A1ez-vilar%C3%B3/' target='_blank'>Carlos Páez Vilaró</a> war ein uruguayischer Künstler, der unter Einbeziehung der grafischen und farbenfrohen Ästhetik der afro-uruguayischen Kultur  alltägliche Szenen und Landschaften darstellte. Er wurde am 1. November 1923 (also das gleiche Geburtsjahr wie mein Vater)  in Montevideo, Uruguay, geboren und arbeitete als junger Mann als Drucklehrling in Buenos Aires. Páez Vilaró kehrte Ende der 1940er Jahre nach Montevideo zurück, um seine Kunstkarriere fortzusetzen.",
