    title: "Trampen",
    description:
      "Auf dem Rückweg vom Casa Pueblo halten wir den Daumen raus und Nely und Stephan halten. Sie kommen aus Kanada, sind aber dorthin aus Bulgarien imigriert. Nely hat eine Villa am Schwarzen Meer, die sie mit den Anregungen vom Casa Pueblo renovieren will. Die beiden erzählen uns über ihre Erfahrungen in Montevideo und die Tatsache, dass da gerade eine Mückenplage herrscht bringt uns zu der Entscheidung, dass wir noch 2 Tage länger in Punta del Este bleiben und nur noch 3 Nächte in Montevideo bleiben.",
