    description:
      "Das Essen besteht aus drei Koteletts, darauf geröstete Zwiebeln, darauf Scheiben mit gekochtem Schinken, darauf Scheiben von knusprigem Ham & Bacon (gebackenem Schinkenspeck), Käse und Spiegeleiern. Dazu gibt es reichlich Pommes Frites. Die Restaurant haben hier meistens zwischen 16 und 20h geschlossen. Deswegen kommt für uns nur das späte Essen infrage, was Abends ein Genuss, des Nachts ein Last und am Morgen ein Völlegefühl bedeutet.",
