    description:
      "Trinität. Das wunderbare Bild eines meiner Lieblingskünstler sehen wir in der Fußgängerzone in Montevideo (Bergblick). Es gibt eine Außenausstellung mit Bildern aus dem Museo nacional del Prado (Madrid). Da kommen wir zufällig am Samstag hin und würde gerne das Museum besuchen, aber wir sind nur 2 Stunden da, das ist zu wenig Zeit, also müssen da noch ein anderes Mal hin.",
