    title: "Plaza Independencia",
    description:
      "Der Plaza Independencia ist der Hauptplatz in Montevideo und bildet den Eingang zur Ciudad Vieja, der Altstadt.\n<br><br>\nMitten auf dem Platz steht die Statue von General José Gervasio Artigas, eine der wichtigsten Persönlichkeiten Uruguays im Kampf um die Unabhängigkeit des Landes. Unter der Statue befindet sich ein Mausoleum, in dem seine Überreste liegen.",
