    ord: 1240,
    video: false,
    copyright: "© EckiHag",
    title: "Religion in Uruguay",
    description:
      "Diese Mosche sehen wir an der Küstenstraße direkt am Strand. Es gibt aber tatsächlich nicht viele Muslime in Uruguay.\nDas Christentum ist die größte Religion, wobei Katholiken die meisten Anhänger haben, aber im Jahr 2021 sind rund 44,5 % der Bevölkerung nicht religiös. Kirche und Staat sind seit 1916 offiziell getrennt.\n<br><br>\nDiskriminierung aus religiösen Gründen ist gesetzlich strafbar und die Regierung respektiert im Allgemeinen die Religionsfreiheit der Menschen. Abgesehen vom Christentum und in geringerem Maße von Afro-Umbandists  (ein Mix aus Katholizismus mit afrikanischen traditionellen Religionena) und dem Judentum sind andere Weltreligionen wie Islam, Buddhismus und Hinduismus usw. im Land kaum vertreten.",
    image: "./uploads/picscollection/2024-03-01_15-37-31-3c68f2d0-d7d9-11ee-a1f5-4569b099fa6c.jpg",
    belongstosource: "isfromaplace",
