    ord: 1320,
    video: false,
    copyright: "© EckiHag",
    title: "Cantombe",
    description:
      "Am letzten Abend, nachdem wir mit Gaby und Sony, einem Ehepaar aus Hamburg essen waren, erleben wir noch einen Karnelvalszug. Eine der am tiefsten verankerten Traditionen ist der Candombe – ein traditioneller Tanz und Rhythmus, der besonders den Karneval in Uruguay ausmacht.\r\n<br><br>An Straßenrändern lodern kleine Feuer, an die Trommeln erwärmt werden, die Gruppen formieren sich und ziehen dann nacheinander durch die Straße. Zu Beginn gibt es einen Tuchträger, auf dessen Tuch die Herkunft der Gruppe steht, dann kommen Fahnenschwenker, dann eine Gruppe von kostümierten Tänzerinnen, dann Solotänzerinnen, die in besonderer Weise gekleidet sind, meistens schwarze lange Frauen mit besonderem Kostüm und Kopfschmuck. Das Ende der Gruppe bilden ca. 20 bis 30 Trommlern.\r\nIn Montevideo geht der Karneval über 40 Nächte, von Mitte Januar bis Anfang März. Zu dieser Zeit finden an jedem Abend überall in Montevideo Tablados (Karnevalshows) statt. Welch ein Glück, dass wir das noch erlebt haben.",
    image: "./uploads/picscollection/2024-03-02_15-53-08-957f5410-d8a4-11ee-aa05-e5b5404af8ce.jpg",
